INSERT INTO `calendar_entry` (`id`, `title`, `description`, `start_datetime`, `end_datetime`, `all_day`, `participation_mode`, `recur`, `recur_type`, `recur_interval`, `recur_end`, `color`, `allow_decline`, `allow_maybe`, `time_zone`, `participant_info`, `closed`, `max_participants`) VALUES
(1, 'Techlab 1 - Time management & workflow', '**Session 1 - “Time management and organizing workflow”**\r\n(Date: Wednesday, 3rd April; Time: 13.30-15.00; Room: AH-A 228)\r\n\r\nIntro to the SoSe 2019: \r\n- We will quickly walk through the syllabus;\r\n- Gaia Mosconi and Philipp Schubert will present the methods and tools catalog - built in the social platform “Research Hub” - and based on the input provided in the Techlab Winter Semester 2018/19; \r\n\r\nAfter the intro, we will explore the first topic **“Time management and organizing workflow”**. We will dig more into the issue of productivity, time management, workflow and explore possible best practices. \r\n- Timo Kaerlein will show how the CRC coordination is using Trello to support their work;  \r\n- Gaia Mosconi will show a tool called “Bear” and “Nuclino” both already mentioned in WiSe 2018 but not explored in details. \r\nWe invite all of you to show us what works for you the best but also what are your major struggles concerning time management, workflow, and productivity. \r\n\r\n', '2019-04-03 13:30:00', '2019-04-03 15:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(2, 'Techlab 2 - \"Principles of ethnography\"', 'Session 2 - “Principles of ethnography and how to conduct it” \r\n(Date: Tuesday, 16th April; Time: 12.30- 14.00; Room: AH-A 228)\r\n\r\nHelena Karasti will be our invited speaker. \r\n\r\nThe session will provide two main input:\r\n- What are the principles of ethnographic research?  (15 min) \r\nNatural settings, holism, descriptive, member’s point of view \r\n\r\n- What are the main methods and techniques of ethnography? (15) \r\nConstructing the field, participatory observation, interviews...\r\n\r\nAfter each input, we will have a 30 min of plenary discussion.\r\n\r\nWe invite all of you who are working with ethnographic methods to join, share and learn together! \r\n', '2019-04-16 12:30:00', '2019-04-16 14:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(3, 'Tech lab 3 - Writing & literature management', '**Session 3 - “About writing and literature management”**\r\n(Date: Tuesday, 30th April; Time: 12.30- 14.00; Room: AH-A 228)\r\n\r\nIn this session, we will continue to explore the theme of writing practices and literature management. We will speak and explore tools that support writing and document production, organization of field notes and literature, editing practices (how you edit your own work and the work of others).\r\n\r\nIn particular, we will have two main input: \r\n- Simon Holdermann will show how to use Citavi for collecting ethnographic fieldnotes and literature management\r\n- Roger Norum will show us Scrivener: [https://www.literatureandlatte.com/scrivener/overview ]()\r\n', '2019-04-30 12:30:00', '2019-04-30 14:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(4, 'Tech lab 4 - Behind the scenes of ethnography', '**Session 4 - “Behind the scenes of ethnography and ethnographic analysis”**\r\n(Date: Wednesday, 15th May; Time: 13.30-15.00; Room: AH-A 228)\r\n\r\nHelena Karasti will be our invited speaker \r\n\r\nHelena will provide two main input:\r\n- Behind the scenes of ethnography (15 min): \r\nWe will dive into reflexivity, emotional work, ethical conduct\r\n\r\n- Ethnographic analysis (15 min) \r\n\r\nAfter each input, we will have a 30 min of plenary discussion\r\n\r\nWe invite all of you who are working with ethnographic methods to join, share and learn together! \r\n', '2019-05-15 13:30:00', '2019-05-15 15:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(5, 'Tech lab 5 - Hands on Digital methods', '**Session 5 - “Hands on Digital methods”**\r\n(Date: Wednesday, 29th May; Time: 13.30-15.00; Room: AH-A 228)\r\n\r\nIn this session, we will continue to explore the world of Digital Methods with input from two international scholars. It won’t be a traditional lecture but participants will also have the time to a new tool: KUMU.\r\n\r\n- James Gien Wong (co-founder of Stop-Reset-Go initiative): presentation of planetary boundaries, related approaches, and plans;\r\n- Ken Carroll (founder of BumpConductor): presentation on BUMP “Big Unsolved Meaningful Problems Worth Solving”;\r\n- Elaboration of KUMU (data visualization platform to organize complex information)\r\n- **Hands-on time with KUMU** ([www.kumu.io]()) to create interactive relationship maps; BUMPS to tackle will be selected according to research priorities of the participants (priorities to be collected from participants before the session, readings will also be provided)    \r\n', '2019-05-29 13:30:00', '2019-05-29 15:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(6, 'Tech lab 6 - Platform design', '**Session 6 - “ Platform design for collaborative research”**\r\n(Date: Wednesday, 26th June; Time: 13.30-15.00; Room: to be confirmed)\r\n\r\nIn this session, we will dive into the topic of collaborative research. In particular, we will ask ourselves what kind of platform design could better support collaborative, interdisciplinary and displaced research. \r\n\r\n- Asli Telli will show the backbone of Mapping Funds project ([www.mappingfunds.com]()) and elaborate on the file-sharing, web infrastructure and external gadget embeds. She will also comment on the challenges and learning curve related to an open-source learning management system ([https://coworkingsquares.de/en-US]()) they have adapted in their research platform for collaborative teams. \r\n\r\n- Gaia Mosconi, Philipp Schubert, and other colleagues will show what they have learned about platforms development for research collaboration in the last two years.  They used eXo first ([https://www.exoplatform.com/company/community-faq/]()) and now HumHub ([https://humhub.org/en]()) as Open Source software. \r\n', '2019-06-26 13:30:00', '2019-06-26 15:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL),
(7, 'Tech lab 7 - Security and ethics', '**Session 7 - “Security and ethics: towards guidelines for data management”**\r\n(Date: Wednesday, 10th July; Time: 13.30-15.00; Room: AH-A 228)\r\n\r\n- We will brainstorm and map concerns related to data security and ethics. We will identify practices that we perform during the research process and check in which ways those practices are in synergies with security and ethical issues. \r\n\r\n- The aim of the session will be to develop together guidelines for data management that will take into account and express the most important concerns. \r\n\r\nThe guidelines should be useful to work in a team as well as guide oneself for data management. \r\n', '2019-07-10 13:30:00', '2019-07-10 15:00:00', 0, 2, NULL, NULL, NULL, NULL, '#6fdbe8', 1, 1, 'Europe/Berlin', '', 0, NULL);
