(38, 'Perhaps you discussed this elsewhere before, but I would like to draw your attention to this:\r\n\r\n[https://www.uni-siegen.de/start/die_universitaet/organisation/organe_und_vertretungen/](https://www.uni-siegen.de/start/die_universitaet/organisation/organe_und_vertretungen/) > Ethikrat\r\n\r\n[https://www.uni-siegen.de/start/die_universitaet/organisation/organe_und_vertretungen/index.html.en](https://www.uni-siegen.de/start/die_universitaet/organisation/organe_und_vertretungen/index.html.en) > Ethics Council\r\n\r\n> “Antragstellung” | “Applications”.\r\n\r\n.', 'humhub\\modules\\cfiles\\models\\File', 19, '2019-07-12 10:04:34', 14, '2019-07-12 10:04:34', 14),
(39, 'It seems document editor is not working properly. I also tried to open file but failed. Only download is working for me!', 'humhub\\modules\\cfiles\\models\\File', 18, '2019-07-13 18:30:11', 23, '2019-07-13 18:30:11', 23),
(40, 'Here the PDF to the informed consent', 'humhub\\modules\\post\\models\\Post', 35, '2019-07-15 10:42:17', 10, '2019-07-15 10:42:26', 10),
(41, 'Something similar to the umich-dataguide should not be really a technical project in ZIMT responsibility. But it should be a nice project for the [data security officer at Siegen University](https://www.uni-siegen.de/start/die_universitaet/organisation/organe_und_vertretungen/datenschutz/) in collaboration with [e-science-service](https://e-science-service.uni-siegen.de/) and others.\r\n\r\nI like the clear classification for data in security perspective. That’s something we need in further RDM service development. IMHO one (german) cross-organizational effort should help - the challenges are the same at most research institutions.  (DFG-)funded work started but it’s difficult to keep track of …  :\r\n\r\n* [https://www.gesis.org/en/research/research-data-management/data-security-and-data-protection/](https://www.gesis.org/en/research/research-data-management/data-security-and-data-protection/)\r\n* [http://www.qualiservice.org/index.php?id=39](http://www.qualiservice.org/index.php?id=39)\r\n* [https://www.forschungsdaten-bildung.de/info-datenschutz](https://www.forschungsdaten-bildung.de/info-datenschutz)\r\n* …', 'humhub\\modules\\post\\models\\Post', 35, '2019-07-15 11:55:02', 14, '2019-07-15 11:55:02', 14),
(42, 'Very good input Volker, thanks! ', 'humhub\\modules\\post\\models\\Post', 35, '2019-07-15 13:15:04', 10, '2019-07-15 13:15:04', 10),
(43, 'Thanks for the audio file, Phillip. Through the introduction of Mapping Funds Platform (www.mappingfunds.com) and our network mapping domain (www.graphcommons.com) here are some questions that arised during group discussion: \r\n\r\n\\*How can we turn digital network mapping into a collaborative exercise?\r\n\r\n\\*Is there any way platform/s can ease access to visual maps? Can some parts of this work be crowdsourced?\r\n\r\n\\*Which level are we aiming at? Participation, engagement or interactivity? This also includes developing network map literacies.\r\n\r\n\\*Can we make protocols with other technologies/tools to carry out the mapping exercise directly in the backend of the platform? (i.e with GraphCommons, Kumu)\r\n\r\n\\*How much of the data can we make available? How can we curate data collaboratively for commons\\` social good?\r\n\r\nHope to continue the discussion:) ', 'humhub\\modules\\linklist\\models\\Link', 38, '2019-07-20 13:39:13', 22, '2019-07-20 13:39:13', 22),
(44, 'lots of good content, here. Thanks:) The last stories/scenarios discussed are intriguing. Secure chat/video call is always a sensitive issue in ethnographic research: I\\`m glad wire and jitsi came up as considerably secure tools. Iagree that research ethics must not stay individual, but become part of public debate. ', 'humhub\\modules\\linklist\\models\\Link', 39, '2019-07-20 15:16:10', 22, '2019-07-20 15:16:10', 22),
(45, 'Thanks for the input, [Asli Telli](mention:80588508-629c-4c7c-8d18-335b8ae2d5ad \"/index.php?r=user%2Fprofile&cguid=80588508-629c-4c7c-8d18-335b8ae2d5ad\")! We will continue on these and more during the winter term i hope! ', 'humhub\\modules\\linklist\\models\\Link', 38, '2019-07-20 15:25:54', 10, '2019-07-20 15:25:54', 10),
(46, 'likewise:)', 'humhub\\modules\\linklist\\models\\Link', 38, '2019-07-20 15:30:56', 22, '2019-07-20 15:30:56', 22),
