INSERT INTO `custom_pages_container_page` (`id`, `title`, `icon`, `page_content`, `type`, `sort_order`, `in_new_window`, `admin_only`, `cssClass`) VALUES
(1, 'Welcome', 'fa-info-circle', '##Welcome everyone##\r\nThe Research Tech Lab, coordinated by sub-projects INF and A05, is an open forum for exchange for all members of the SFB 1187.\r\n\r\nIn the Research Tech Lab, we explore and discuss, and design digital research approaches, tools, and instruments. The basic assumption of the Research Tech Lab is that IT design takes place in everyday use and involves the continuous appropriation of **(digital) methods, tools, instruments, and infrastructures**. \r\n\r\n“Design” is an important part of daily research practices in many ways. The Research Tech Lab thus calls for participation of all sub-projects. Based on a \'Living Lab\' approach, the sub-projects are given the opportunity to **discuss, analyze, and reflect their experiences** with research tools and infrastructures. In the winter semester 2018, the Research Tech Lab will work in close connection with Locating Media graduate school. Each session will aim at building a catalogue for tools and methods used in the SFB and Locating Media context. The catalogue will be built using the SFB social platform http://social.sfb1187.uni-siegen.de/ and it aims to be used in the future as an “active inventory”, a place in which issues with tools and methods can be discussed and beyond, an organizational memory fruitful for future students and academics.', 4, 1, 0, 0, ''),
(2, 'Welcome', 'fa-adjust', '', 4, 1, 0, 0, '');
INSERT INTO `custom_pages_template` (`id`, `name`, `engine`, `description`, `source`, `allow_for_spaces`, `type`, `created_at`, `created_by`, `updated_at`, `updated_by`, `allow_inline_activation`) VALUES
(1, 'system_two_column_layout', 'twig', 'Simple two column layout.', '<div class=\"row\">\r\n	<div class=\"col-md-8\">\r\n		<div class=\"panel panel-default\">\r\n			<div class=\"panel-body\">\r\n				{{ content }}\r\n			</div>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-md-4\">\r\n		<div class=\"panel panel-default\">\r\n			<div class=\"panel-body\">\r\n				{{ sidebar_container }}\r\n			</div>\r\n		</div>	\r\n	</div>\r\n</div>', 0, 'layout', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(2, 'system_one_column_layout', 'twig', 'Simple one column layout.', '<div class=\"row\">\r\n	<div class=\"col-md-12\">\r\n            <div class=\"panel panel-default\">\r\n			<div class=\"panel-body\">\r\n                            {{ content }}\r\n                        </div>\r\n            </div>\r\n	</div>\r\n</div>', 0, 'layout', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(3, 'system_headline_container', 'twig', 'Simple headline row with background image.', '{% if background.empty %}\r\n    {% set bg = assets[\'bgImage2.jpg\']  %}\r\n{% else %}\r\n    {% set bg =  background %}\r\n{% endif %}\r\n\r\n<div style=\"height:218px;overflow:hidden;color:#fff;background-image: url(\'{{ bg }}\');background-position:50% 50%;text-align:center;\">\r\n	<div style=\"padding-top:40px;\">\r\n		<h1 style=\"color:#fff;font-size:36px;margin:20px 0 10px;\">{{ heading }}</h1>\r\n		<hr style=\"max-width:100px;border-width:3px;\">\r\n		 <span>{{ subheading }}</span>\r\n  	 </div>\r\n</div>', 0, 'container', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(4, 'system_article_container', 'twig', 'Simple richtext article.', '<div style=\"margin-top:15px;\">\r\n	<div style=\"padding:0 15px;\">\r\n		{{ content }}\r\n	</div>\r\n</div>', 0, 'container', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(5, 'system_simple_snippet_layout', 'twig', 'Simple snippet layout with head container and richtext.', '<div>\r\n        {{ heading }}\r\n</div>\r\n<div style=\"margin-top:15px;\">\r\n	{{ content }}\r\n</div>', 0, 'snipped-layout', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(6, 'system_download_item', 'twig', 'Single download item.', '<div class=\"download-item\">\r\n    {{ file_download }}\r\n</div>', 0, 'container', '2019-03-08 19:51:44', NULL, NULL, NULL, 0),
(7, 'system_download_list', 'twig', 'File download list.', '<div class=\"download-list\">\r\n    {{ download_list }}\r\n</div>', 0, 'container', '2019-03-08 19:51:44', NULL, NULL, NULL, 0);
