(18, 4, 'https://uni-siegen.sciebo.de/apps/files/?dir=/SFB-Students/4_Techlab%20audio%20file/3_SoSe%202017&fileid=58828154', 'Session 1 - “Research data management and SFB Intranet: Sharing research practices”', 'This first session dealt with research data management and presented the “SFB Intranet” platform (beta version), a social network for sharing research practices', 0),
(19, 5, 'https://uni-siegen.sciebo.de/apps/files/?dir=/SFB-Students/4_Techlab%20audio%20file/4_WiSe%202017%3A18&fileid=58828562', 'Session 1 WiSe 2017/18', '', 0),
(20, 6, 'https://uni-siegen.sciebo.de/s/9apPA9ohU8jjg6z', 'Session 1 - \"Getting organised\" (30.10.2018)', 'We explored the first topic “Getting organized”: issues like productivity, time management, project management, self-work management were part of the session; practices, methods, and tools (achievement apps etc.) in support of the research process were presented;', 0),
(21, 6, 'https://uni-siegen.sciebo.de/s/zKGjZVJuqVqT6b8', 'Session 2 - “About writing and more” (6.11.2018)', 'The difficulty of getting the writing done! From the literature collection/management to the writing process; which tools support us better, which reasons behind a tool’s choice, which tools are really needed? (tools like mind-maps etc.) ', 0),
(22, 6, 'https://uni-siegen.sciebo.de/s/EU8vh87wcFEOnGk', 'Session 3 -  “Ethnographic methods and Qualitative data analysis” (20.11.2018)', 'We brainstormed major issues participants had with ethnographic methods and qualitative data analysis', 0),
(23, 6, 'https://uni-siegen.sciebo.de/s/uVcxoGkvnp6ocTN', 'Session 4 - “Digital methods” (4.12.2018)', 'Introduction to Digital Methods (Carolin Gerlitz) ', 0),
(24, 6, 'https://uni-siegen.sciebo.de/s/5HzAxeWHeO93RL6', 'Session 5 - “Data visualization” (18.12.2018)', 'Data visualization: hands-on with Gephi ', 0),
(25, 6, 'https://uni-siegen.sciebo.de/s/6FsIbE7lXAN1mBV', 'Session 6 - “Work-around strategies: What if there is no tool/method available?” (8.01.2019)', 'How to be flexible and innovative in certain areas where methods and tools are not available? ', 0),
(26, 6, 'https://uni-siegen.sciebo.de/s/31Zhi0L3GpoOFFS', 'Session 7 - “Help Desk” (22.01.2019)', 'Ethics and data security ', 0),
(27, 4, 'https://uni-siegen.sciebo.de/s/WbLBjx1nVC0pxTK', 'Session 2 - “Digital research methods for online communities and social media”', 'This module discussed techniques and methods for setting up, maintaining, and studying online communities over time. ', 0),
(28, 4, 'https://uni-siegen.sciebo.de/s/4QP38yfU2hDGQZk', 'Session 3 - “From words to meaning: Techniques for analysis textual documents: archival material and editions\"', 'This module explored tools and techniques for analyzing textual documents in the fields of history, editions, and sociology. The aim of the session was to learn how different projects and disciplines deal with texts and create meaning by using analog and/or digital tools.', 0),
(31, 6, 'https://eportfolio.wineme.fb5.uni-siegen.de/index.php/s/research-tech-lab-gestaltungslabor-sfb118/wiki/page/view?title=Getting+organised', 'Session 1 - tools explored', '', 0),
(32, 7, 'https://uni-siegen.sciebo.de/s/YlHQr7DIIneJcoB', 'Session 1 - 03.04.2019 - Time management', '“Time management and organizing workflow”. We will dig more into the issue of productivity, time management, workflow and explore possible best practices. ', 1),
(33, 7, 'https://uni-siegen.sciebo.de/s/drJIsTiCULJK3Hb', 'Session 2 - 30.04.2019 - Ethnography part 1 ', '\"Principles of ethnography and how to conduct it”. Helena Karasti was our invited speaker.  The session provided two main input:\r\n1) What are the principles of ethnographic research? \r\n2) What are the main methods and techniques of ethnography? \r\n\r\nIn the shared folder you will find: 1) the audio file; 2) some literature; 3) the slides. \r\n', 2),
(34, 7, 'https://uni-siegen.sciebo.de/s/hTd02lff4TJcOtF', 'Session 3 - 30.04.2019 - Writing and literature management ', 'In this session, we explored the theme of writing practices and literature management. In particular, Roger Norum introduced a tool called Scrivener a powerful word processing programme. ', 3),
(35, 7, 'https://uni-siegen.sciebo.de/s/aZmsyWDs8d1fpcw', 'Session 4 - 15.05.2019 - Ethnography 2', '\"Behind the scenes of ethnography and ethnographic analysis”. Helena Karasti as an invited speaker. Helena provided input on: reflexivity, positionality, emotional work, and ethical conduct. We did not explore ethnographic analysis in depth, only 10 minutes in the end. \r\n', 4),
(36, 7, 'https://uni-siegen.sciebo.de/s/N3AaC29GufFrLu5', 'Session 5 - 29.05.2019 - Hands on Digital methods', 'Hands on Digital methods - Presentations from actual projects where digital methods are used to manage communities or display data.', 5),
(37, 1, 'https://docs.google.com/document/d/1jDs7xQvrQCCNdx3tE-S66AbOsB8FHFr_hEEeRrUzRLw/edit?usp=sharing', 'The meeting protocol _Google Drive', '', 0),
(38, 7, 'https://uni-siegen.sciebo.de/s/eQTWvTzhMuFjZMC', 'Session 6 - 26-06-2019 - Platform design for collaborative research - Presentation', 'In this session, we will dive into the topic of collaborative research. In particular, we will ask ourselves what kind of platform design could better support collaborative, interdisciplinary and displaced research.', 6),
(39, 7, 'https://uni-siegen.sciebo.de/s/2DivkZeCZHpLtQu', 'Session 7 -  10.07.2019 “Security and ethics: towards guidelines for data management”', 'We will brainstorm and map concerns related to data security and ethics. We will identify practices that we perform during the research process and check in which ways those practices are in synergies with security and ethical issues.', 7);
