(5, 'humhub\\modules\\comment\\models\\Comment', 20, 'Dr. Helena Karasti - Computerunterstützte Gruppenarbeit und Soziale Medien | Universität Siegen', 'https://www.cscw.uni-siegen.de/team/karasti/', 'https://www.wineme.uni-siegen.de/wp-content/uploads/2016/11/volker_wulf.jpg', 'Dr. Helena Karasti Mail: Helena.Karasti(at)uni-siegen.de Raum: US-D 105 Telefon: Vita Helena Karasti is an interdisciplinary scholar with longitudinal research interests in ethnographic practice studies, participatory design, computer supported collaborative work and information infrastructure studies. Her main empirical domains of investigation include healthcare and environmental research. She has published in the topic areas of scientific data/information …'),
