(2, NULL, 'Hi Guys, today Philipp and I played a little bit with Humhub and we created a new space for the Research Tech Lab! We are very excited! We will share with you what we understood and done next week. Philipp and i will not join you tomorrow. \\\r\nIn the meantime, I will create a doc file (and share it with you) in which i will gather together all the things that could be improved in Hubhum!! Do you have any preferences of filesharing cloud service? ', NULL, '2019-03-12 12:25:33', 10, '2019-03-12 12:25:33', 10),
(3, NULL, 'New Feature: We activated the Meetings module that lets you set up meetings, define an agenda, and take minutes. The module is automatically added to every space (but you can of course deactivate it). Try it out or check out more information about the module at [https://www.humhub.org/de/marketplace/details?id=18](https://www.humhub.org/de/marketplace/details?id=18)', '1', '2019-03-21 15:34:23', 6, '2019-03-21 15:34:23', 6),
(6, NULL, 'test too', NULL, '2019-03-27 10:44:20', 7, '2019-03-27 10:44:20', 7),
(7, NULL, '[https://docs.google.com/document/d/1n6g5DppU6XgrsvXlPiRbdWxb4UK_PY0heRVZ0uKdo98/edit](https://docs.google.com/document/d/1n6g5DppU6XgrsvXlPiRbdWxb4UK_PY0heRVZ0uKdo98/edit)', '1', '2019-03-27 12:57:51', 10, '2019-03-27 12:57:51', 10),
(9, NULL, 'Looking forward to starting a new semester with you guys! From 13.30 till 15.00 in room 228.\r\n\r\nTopic of the day: **Time management and organising workflow”**.', NULL, '2019-04-03 12:09:12', 10, '2019-04-03 12:18:44', 10),
(10, NULL, 'Time planning from March 27, 2019', NULL, '2019-04-09 12:05:49', 6, '2019-04-09 12:05:49', 6),
(11, NULL, 'Hello everyone, \r\n\r\nthis is a kind reminder for the second session of the Research Tech Lab. **It will be next Tuesday (16th April) from 12.30 till 14.00 in room AH-A 228.**\r\n\r\nThe topic of the session is **“Principles of ethnography and how to conduct it”** and we will have Helena Karasti\\* as invited speaker. Helena will provide two main input:\r\n\r\n1\\. What are the principles of ethnographic research? (15 min)\r\n\r\n2\\. What are the main methods and techniques of ethnography? (15 min)\r\n\r\nAfter each input, we will have a 30 min of plenary discussion. Helena suggests three optional papers you can read (optional). You can download the PDF at this link: [https://uni-siegen.sciebo.de/s/drJIsTiCULJK3Hb](https://uni-siegen.sciebo.de/s/drJIsTiCULJK3Hb).\r\n\r\n* Blomberg et al. pp. 123-129\r\n\r\n* Karasti 2001 Dissertation, chapter 3\r\n\r\n* Karasti & Blomberg 2018, chapter 3.-3.2, pp. 240-250\r\n\r\n\\\r\nLooking forward to meeting you next week!', '1', '2019-04-12 15:21:47', 10, '2019-04-12 15:21:47', 10),
(12, NULL, 'test on the posting access', NULL, '2019-04-23 13:43:38', 13, '2019-04-23 13:43:38', 13),
(13, NULL, 'Hi guys, \\\r\n\\\r\ntomorrow (30th April) from 12.30 till 14.00 in room AH-A 228 we will meet for the third session  **“About writing and literature management” .**\r\n\r\nWe will speak and explore tools that support writing and document production, organization of field notes and literature, editing practices (how you edit your own work and the work of others).\r\n\r\nIn particular, we will have two main input:\r\n\r\n* Roger Norum will show us Scrivener: [https://www.literatureandlatte.com/scrivener/overview](https://www.literatureandlatte.com/scrivener/overview)\r\n\r\n* Simon Holdermann won’t be with us in person but he prepared some slides to show how to use Citavi for collecting ethnographic fieldnotes and literature management. \r\n\r\nLooking forward to seeing you!', '1', '2019-04-29 11:58:09', 10, '2019-04-29 11:58:09', 10),
(14, NULL, 'Simon Holdermann’s presentation on Citavi - Session 3 Research Tech Lab - 30th April 2019', NULL, '2019-04-29 12:02:08', 10, '2019-04-29 12:02:08', 10),
(16, NULL, 'Istiaq: the orcid profile is working now we just need to test it in the server\r\n\r\n* Simon and Istiaq will text it this week and by next week will be done!\r\n\r\nMesbah:\r\n\r\nInstead of using Webdav, he find a better(can make access account seperated) tool to implient: [http://sabre.io/dav/davclient/](http://sabre.io/dav/davclient/).\r\n\r\nsciebo integration - if you create a file in Sciebo will be displayed in the platform; if you create a file in the platform will be displayed in Sciebo (Webdav ??? )\r\n\r\n* What about renaming a file? -- yes\r\n\r\n* What about visualizing the access right? -- need to check (task)\r\n\r\n* What about visualizing comments, activities, versions? --need to check (task)\r\n\r\nPhilipp:\r\n\r\nGaia suggest push forward the easy stuff:\r\n\r\n* Meet with Philipp, Ashik and Simon for Profile', '1', '2019-06-26 12:59:47', 13, '2019-06-26 12:59:47', 13),
(17, NULL, 'Here we have the OneDrive folder', '1', '2019-07-03 13:06:16', 10, '2019-07-03 13:06:39', 10),
(18, NULL, '*\\*\\*Resource:*\r\n\r\nThis is the link to the paper in OneDrive\r\n\r\n[https://onedrive.live.com/edit.aspx?cid=173d6a6416ff3148&page=view&resid=173D6A6416FF3148!1078&parId=173D6A6416FF3148!1074&app=Word](https://onedrive.live.com/edit.aspx?cid=173d6a6416ff3148&page=view&resid=173D6A6416FF3148!1078&parId=173D6A6416FF3148!1074&app=Word)', '1', '2019-07-03 13:07:48', 10, '2019-07-03 13:15:24', 10),
(19, NULL, '***Good practices:*** *\\\r\n\\\r\n**1) Literature*** - for each paper ready, write a summary saying what is the paper contribution, why it is (or is not) interesting, and how it connect with the paper that we currently writing. \\\r\n**2) Posts -** start the post with a keyword (or key expression) - e.g. “Good practice” - that can be used to filter the posts', NULL, '2019-07-03 13:14:38', 29, '2019-07-03 13:14:55', 29),
(20, NULL, '*\\*\\*TODOs:* \r\n\r\n* **Gaia:** contact Alan and ask about VSD can be used only as a theoretical lens\r\n* **Qin:** find supportive quotes from the empirical data and insert them in the Onedrive file\r\n* **Fabiano** will go trough the paper and work out the structure and the argument', NULL, '2019-07-03 13:27:11', 10, '2019-07-03 13:27:11', 10),
(21, NULL, '*\\*\\* Tasks for next time:*\r\n\r\n* Gaia will check her Orcid profile, see how it works and test it\r\n* [Simon Gruseck](mention:2b997e2e-e953-4231-a8c3-42bb35fcf471 \"/index.php?r=user%2Fprofile&cguid=2b997e2e-e953-4231-a8c3-42bb35fcf471\") and [Istiaq khan](mention:ff5f3e8d-5e3f-4800-829c-d0949fde4fd7 \"/index.php?r=user%2Fprofile&cguid=ff5f3e8d-5e3f-4800-829c-d0949fde4fd7\") will fix the technical problems with Orcid and then let everybody know so Gaia will test it\r\n* Students will send to Gaia’s screenshots for the stuff they implemented in their local machines\r\n* [Nico Vitt](mention:e5814390-cfe2-40c3-b5be-653f5aaf08c9 \"/index.php?r=user%2Fprofile&cguid=e5814390-cfe2-40c3-b5be-653f5aaf08c9\") will change the url to Research-Hub.social', NULL, '2019-07-03 14:13:21', 10, '2019-07-04 10:34:17', 10),
(22, NULL, 'Istiaq and Simon:\r\n\r\nRedirection problem, it is working, it will be figured after today’s meeting.\r\n\r\nS:Is server backed up?\r\n\r\nNico: needs to ask Timm.\r\n\r\nThe interface is changed a bit, it will expand if you click the category.\r\n\r\nGaia wants to finish her Orchid information and test it in humhub\r\n\r\nS: Mendeley API, there is expired issue. Legal perspective need to ask Nico.\r\n\r\nN: PHP provides the Jason power.\r\n\r\nAshik:\r\n\r\nThere are exams those weeks so not much progress.\r\n\r\nThe space and community is done, the sign of each community have not been done.\r\n\r\nG: is it possible to visualize the community and spaces there?\r\n\r\nNext Friday will synchronize the development from local to the main server.(with Simon)\r\n\r\nSend the sceen-shots to Gaia today.\r\n\r\nMesbah and Marvin:\r\n\r\nWe can not get the directory from the API\r\n\r\nShowed the prototype:\r\n\r\n\\-We can delete function is working,\r\n\r\n\\-create new G-drive(folder) and sciebo(file) in humhub, but we cannot see the file type.\r\n\r\nG: give the possibility of “data type” in the create file function.\r\n\r\nAt the moment the user is not able to create folders or files.\r\n\r\nSend the screenshot to Gaia\r\n\r\nThe designed the prototype how to search the files, maybe can send Gaia this will.\r\n\r\nAshik suggest the function of creating the folder or files by right click.\r\n\r\nGaia suggest offer the both option.\r\n\r\nM: we have to do it from scratch.\r\n\r\nA: just add the click on more actions.\r\n\r\nIn the next week should be functional for both folder and files.\r\n\r\nTrying to see what API could offer the information of who can access the file.\r\n\r\nPhilipp:\r\n\r\nThe functionality of adding the keywords would be working the next wednesday.\r\n\r\nG: We should have a decent link.\r\n\r\nN: we can change into the Research-hub url?\r\n\r\nNico:\r\n\r\nThe things we implement in local, transfer to the server.\r\n\r\nS: Github repository is needed in the future\r\n\r\nN: there is developed one from Timm, maybe we need Hackton in the future.\r\n\r\nG: we need to push the things ready to the server, then we can integrate the artefact to our end-users.\r\n\r\nNext time: 12:00-13:00\r\n\r\nAshik would not able to come, and Istiaq maybe late.', NULL, '2019-07-03 15:01:19', 13, '2019-07-03 15:01:19', 13),
