(32, NULL, 'Hi all.. this is comment if for [Philipp Schubert](mention:17e819ef-ee86-4fed-bf1a-fd3ff823f33b \"/index.php?r=user%2Fprofile&cguid=17e819ef-ee86-4fed-bf1a-fd3ff823f33b\")  in particular.. how did you manage to have a welcome page for the research tech lab? Why i cannot modify it? I think each group space should have that option, but I don’t see any welcome section in any of the other ones, I just drop here the issue here but we can discuss it tomorrow at our weekly meeting', NULL, '2019-07-09 14:16:32', 10, '2019-07-09 14:16:32', 10),
