(34, NULL, 'Simon,\r\n\r\nThe profile cannot link to Orchid, Qin has the same paper as Gaia.\r\n\r\nSimon has issue, it worked once, but it is not working.\r\n\r\nTASK: Talk with Istiaq about the Orchid, and debug it; Meet Ashik and bring things to the server; Trying the mendeley things\r\n\r\nPhilipp:\r\n\r\nRequired an Hackthon for building synergies to bring things together.\r\n\r\nThe suggestion of fields that need to be transmitted from an original function in Humhub,(it could build a common ground for terms), he is searching for the help.\r\n\r\nTASK: Nico will look at the code after the meeting and he will try to fix it.\r\n\r\nMeshba:\r\n\r\nThe File and folder creation could be done in Google and Sciebo.\r\n\r\nPeople can pin the files and it will show in both side.\r\n\r\nTASK: retrieve the information of comments and share to whom.\r\n\r\nMarvin:\r\n\r\nThe font and icon is too small.\r\n\r\nShow people how can create folder and file.\r\n\r\nThe file type is not there for choosing,\r\n\r\nTASK: setting the file type', NULL, '2019-07-10 13:10:37', 13, '2019-07-10 13:10:37', 13),
(35, NULL, 'Hi guys, here some links we discussed and looked at in the last Research Tech Lab session:\r\n\r\n\\\r\n1\\. Data security guidelines from the University of Michigan: [https://research-compliance.umich.edu/data-security-guidelines](https://research-compliance.umich.edu/data-security-guidelines)\r\n\r\n\\\r\n2\\. A guide designed to help you make informed decisions about where to safely store and share university data (again from the University of Michigan) [https://safecomputing.umich.edu/dataguide/](https://safecomputing.umich.edu/dataguide/) - it would be a nice project for ZIMT ([Volker Hess](mention:8ddcb212-5872-47e1-a547-292cbc717e9e \"/index.php?r=user%2Fprofile&cguid=8ddcb212-5872-47e1-a547-292cbc717e9e\")) - ZIMT could come up with something similar perhaps?!\r\n\r\n\\\r\n3\\. A quite detailed informed consent, with clear links to the GDPR regulation, you can find it at the voice - “Where do i find the Notice”:  [https://ria.princeton.edu/General%20Data%20Protection%20Regulation](https://ria.princeton.edu/General%20Data%20Protection%20Regulation) (University of Princeton)', '1', '2019-07-15 10:39:24', 10, '2019-07-15 10:50:39', 10),
(37, NULL, '20190724\r\n\r\nPhilipp:\r\n\r\nHackthon is great!!!!!\r\n\r\nWorking tag input and output, an error occuring. Then he explained the error. Nico had looked at , but it is too complicate, he need to look at it continually\r\n\r\nAshik:\r\n\r\nSpace can assign to multiple communities and showed to the group.\r\n\r\nWill sync the development in the server with Simon this week.\r\n\r\nN, we also need it can be changed.\r\n\r\nIstiaq:\r\n\r\nNo updates, local machine is working but crushed in the server. It is working fine before.\r\n\r\nHe will be working on the errors of Orchid.\r\n\r\nSimon,\r\n\r\nThe work is working with Ashik and Istiaq,\r\n\r\nPublication is getting from the mendeley and being coherent with others.\r\n\r\nWill meeting with Ashik and Istiaq to working on the tasks.\r\n\r\nMarvin:\r\n\r\nFile ban be sorted by coloums, we cannot get the “created” data from Sciebo.\r\n\r\nWe got the email from \\`Zimt\r\n\r\nThe icon for files format do not show up in the humhub. Ashik suggest the solution by creating the chart.\r\n\r\nMeshba,\r\n\r\nThe more bottom and give categories on list information. Which information showing first.\r\n\r\n\\\r\nSven,\r\n\r\nBlock-Chain idea for research academia group.', NULL, '2019-07-24 12:28:50', 13, '2019-07-24 12:28:50', 13),
(38, NULL, '20190731\r\n\r\nGaia:\r\n\r\nCall Philipp about the profile, bcs some researcher wants to use the platform as well. Then it asking for the customized category.\r\n\r\nThe users or the admin should be seen the information in the profile.\r\n\r\nTask: Gaia and Qin need to meet for the profile design.\r\n\r\nPhilipp:\r\n\r\nWe think it is possible to make the roles.\r\n\r\nAshik and Simon:\r\n\r\nCommunity architecture. The post in the community level is not yet available.\r\n\r\nThe difference between the community and space.\r\n\r\nBe able to edit the space to multiple communities in the setting.\r\n\r\nGaia question: is the level of making sense? Is user should create the community?\r\n\r\nN: add the request page to create a community. Differentiate the community and space.\r\n\r\nWe can integrate the page from wordpress,\r\n\r\n(Q and G need to discuss this as well)\r\n\r\nAshik: from my eye it is the same\r\n\r\nBut from the social perspective is different.\r\n\r\nTask:synchronize the post from space to the profile posts.\r\n\r\nIstiaq and Simon:\r\n\r\nSign in with Orcid. Get the same error when linking to orcid, and also problem on data fetching, some information are missing, Gaia’s education is not showing and same paper shows twice.\r\n\r\nMeshba and Marvin:\r\n\r\nSpread a sheet to know about which information should show up first in repository.', NULL, '2019-07-31 15:40:45', 13, '2019-07-31 15:40:45', 13),
(39, NULL, '20190808\r\n\r\nSimon and Istiaq:\r\n\r\nThe Orcid problem is fixed.\r\n\r\nNeed to provide the category for Orcid.\r\n\r\nPhilipp:\r\n\r\nWrite the control for type picker, there is no visible change, but I am working on. Search control waiting to ask.\r\n\r\nQin and Gaia, send him the category, and Community architect, repository. Point out the deadline. Issue of “People will get curious is they saw the spaces”.\r\n\r\nAshik:\r\n\r\nNeed 2 days for post issue in profile.\r\n\r\nMeshba and Marvin:\r\n\r\nNew version of repository interface. ![](https://lh4.googleusercontent.com/nnWKW32kv4-L5m-L3civ7Zp0tF8yws74C0aaaZ3NbeVXcQqjQeIVYVH_Csq0KbOK6LET1Ku8q4Utq0K2m8ZD4So0cuEwj2YlX3mDxCQkRs7XSD3J-D-mlm0ksgbyrLJ2OrHWr6Mn =602x339)\r\n\r\n![](https://lh3.googleusercontent.com/SOO8tohZ_x-4GnJvk5YV54mUiEhcVKV5h3WD-HU-N-Rcg0Dmvpq1gUvV_NgSdOUaniBW9-1nLLjYqlg4lDTMRFOJ1lO_A0t4c37GM5tCCeaf-Ud-L_zlpjbRX7w4Gms2_nsVXDo5 =602x339)', '1', '2019-08-08 11:56:49', 13, '2019-08-08 11:56:49', 13),
