(41, NULL, '20190814\r\n\r\nIstiaq and Simon\r\n\r\nTask: Fetching those data from orchid\r\n\r\n![](https://lh4.googleusercontent.com/ElpC0Lrn40qcFKoov7gl0iyW2UEDgCprgsODAWWIqC_sz0yWqYEd6zbXmgZki6hirwF8YK-bkOM13i9NBnodlg2UTZMgM1jgjfdVoqBkZmegygU3saeMffMpe69BqhFaTbK9BA4a =602x452)\r\n\r\nAlso the information of personal description and basic bio/contact information.\r\n\r\nAshik:\r\n\r\nUsers can see the post form their profile in test machine, but the performance will be bad.\r\n\r\nN: document it for later.\r\n\r\nTASK: the community landing page.\r\n\r\nNico:\r\n\r\nPlease update on the live platform before the end of August.\r\n\r\nWho breaks fix it!!!\r\n\r\nMarvin and Meshba,\r\n\r\nNow the double-side synchronize from sciebo,\r\n\r\nTASK: Google drive uploading function and the “more” section.\r\n\r\nDiscussion about the preview of files. Maybe can use the shortcut from the humhub editor.\r\n\r\n\\\r\nSimon:\r\n\r\nMendeley working on', '1', '2019-08-14 14:14:29', 13, '2019-08-14 14:14:29', 13);
