(10, 'Gaia', 'Mosconi', NULL, NULL, NULL, NULL, NULL, 'DE', NULL, 0, '1988-01-31', 'Gaia Mosconi is a PhD student in CSCW (Computer Supporter Cooperative Work) at the University of Siegen. She received a I level Master in Sociology and a II level Master in “Smart Community Design and Management” at the University of Trento. She applies sociological research methods (mainly Qualitative Research, Action-Research) to the study and development of Information Systems. Her research interests range from civic engagement to research collaboration and data infrastructures. Currently she is investigating how collaborative research data practices and infrastructures are changing under the auspices of the Open Science agenda.  ', NULL, NULL, NULL, NULL, 'gaiaonthemoon', NULL, NULL, NULL, NULL, 'https://www.linkedin.com/in/gaia-mosconi-58634b108/', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'PhD and Research Associate', NULL, 'https://www.researchgate.net/profile/Gaia_Mosconi3', 'https://orcid.org/my-orcid', 'Gaia.Mosconi@uni-siegen.de', 'Few people really have any idea how to do things right and even fewer are to try new things, so usually if you give your best shot at something you\'ll do pretty well.\" -Aaron Swartz', 'Research Data Curation; Infrastructuring; CSCW; Qualitative Research; ', NULL, NULL),
