(2, '747a394c-b4e7-486f-8ebf-5320510fe483', 'Humhub Development', 'Closed group discussing development of this humhub instance', 1, 1, 1, NULL, '2019-03-07 08:57:25', 6, '2019-03-20 14:30:40', 7, NULL, NULL, 8, 0, '#348203', 1, 'humhub-development', 0, 1),
(3, '183e709a-3474-4cb6-a6fd-5e2b9d729357', 'Platform Issues and Suggestions', 'Space for discussing platform improvements, getting tech support and receiving news and updates about the social platform. You can also more safely try out stuff in this space (as in a sandbox).', 2, 1, 1, 'issues', '2019-03-07 09:03:03', 6, '2019-04-02 11:34:34', 7, NULL, 1, 10, NULL, '#0a1577', 1, 'platform-issues-and-suggestions', 0, 1),
(4, '5e468faa-cd70-405b-a34b-5309f668eec6', 'Research Tech Lab (Gestaltungslabor) SFB1187', 'The Research Tech Lab (in German: Gestaltungslabor), coordinated by the SFB sub-projects INF and A05, is an open forum for peer-exchange and support available to all members of the SFB 1187. In the Research Tech Lab we explore, discuss (even design) research approaches, methods, tools, and instruments (digital or traditional). \r\n\r\nThe scope of this space is to bring the offline discussions of each session into a digital and distributed space.  ', 2, 1, 1, 'Research Tech Lab, Discussion, CSCW, ', '2019-03-12 10:24:23', 10, '2019-07-09 14:34:55', 10, NULL, NULL, 14, 1, '#bf5f0b', 1, 'research-tech-lab-gestaltungslabor-sfb118', 0, 1),
(6, '6cf6af45-0694-420d-89f0-eec5a7e13c9c', 'Paper group ECSCW', '', 1, 1, 1, NULL, '2019-07-03 13:03:36', 13, '2019-07-03 13:03:36', 13, NULL, NULL, 34, NULL, '#6b990a', 1, 'paper-group-ecscw', 0, NULL),
(7, 'fdf2b0e8-6b58-43d8-9c28-4d99ed545e3c', 'e-Portfolio ', '', 1, 1, 1, NULL, '2019-07-03 18:42:28', 13, '2019-07-03 18:42:28', 13, NULL, NULL, 36, NULL, '#026d05', 1, 'e-portfolio', 0, NULL),
(8, '676a30a6-ea7f-4ce6-99e6-de98d6e6711a', 'Locating Media Colloqium ', 'A space in which Locaters and other affiliated scholars can share comments, ideas and suggestions related to the LM colloquium ', 2, 1, 1, NULL, '2019-07-09 14:00:00', 10, '2019-07-09 14:35:17', 10, NULL, NULL, 38, 1, '#390c87', 1, 'locating-media-colloqium', 0, NULL);
