(1, 1552382834, 0, 1, 7, 'In this topic, we will discuss tools and methods issues related to:\r\n\r\n* productivity, time management, project management, self-work management; etc... everything you might think of that support the best (or the worst) your work in everyday achievements!'),
(2, 1552382881, 0, 1, 7, 'In this topic, we will discuss tools and methods issues related to:\r\n\r\n* productivity, time management, project management, self-work management; etc... everything you might think of that support the best (or the worst) your work in everyday achievements!'),
(3, 1552382963, 0, 2, 7, 'Digital methods, approaches to tool development and briefly introduce a couple of key tools - where to find them and where documentation exists. Discussion on needs and to find out what the participants are interested in.'),
(4, 1552383018, 0, 3, 7, 'Collection of common challenges/topics from the group.\r\n\r\nOpen discussion about (virtual) ethnography and qualitative data analysis.'),
(9, 1552384019, 0, 7, 7, 'Trello (Tool): [https://trello.com/](https://trello.com/))\r\n\r\nPomodoro technique (method): [link official web page](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\nNuclino: [https://www.nuclino.com/](https://www.nuclino.com/)\r\n\r\nToby: [https://www.gettoby.com/](https://www.gettoby.com/)\r\n\r\nCitavi: [https://www.citavi.com/en](https://www.citavi.com/en)'),
(10, 1552384049, 0, 7, 7, 'Trello (Tool): [https://trello.com/](https://trello.com/))\r\n\r\nPomodoro technique (method): [link official web page](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\nNuclino: [https://www.nuclino.com/](https://www.nuclino.com/)\r\n\r\nToby: [https://www.gettoby.com/](https://www.gettoby.com/)\r\n\r\nCitavi: [https://www.citavi.com/en](https://www.citavi.com/en)'),
(11, 1552384080, 0, 7, 7, 'List of Tools we talked about in the session:\r\n\r\nTrello (Tool): [https://trello.com/](https://trello.com/))\r\n\r\nPomodoro technique (method): [link official web page](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\nNuclino: [https://www.nuclino.com/](https://www.nuclino.com/)\r\n\r\nToby: [https://www.gettoby.com/](https://www.gettoby.com/)\r\n\r\nCitavi: [https://www.citavi.com/en](https://www.citavi.com/en)'),
(12, 1552384143, 0, 8, 7, 'Everything we discussed about Trello'),
(13, 1552384273, 0, 8, 7, 'Qutes about Trello'),
(14, 1552384502, 0, 9, 7, 'Toby: [https://www.gettoby.com/](https://www.gettoby.com/)\r\n\r\nBookmarks organizers!! Wonderful tool!\r\n\r\n\"Bookmarks are for books, not browsers. Organize your browser tabs into Toby so you can access key resources in one click instead of seven\"'),
(15, 1552384519, 0, 8, 7, 'Qutes about Trello'),
(16, 1552384559, 0, 8, 7, 'Trello (Tool): [https://trello.com/](https://trello.com/)'),
(17, 1552384598, 0, 10, 7, 'ASANA is another similar tool [https://asana.com/](https://asana.com/): \r\n\r\n\\- in ASANA you can assign topic directly from your email; when you register in your account you provide an email and you can link topics to it that then get upload in your ASAN board'),
(18, 1552385093, 0, 11, 7, 'The difficulty of getting the writing done! From the literature collection/management to the writing process; which tools/methods support us better, which reasons behind a method/tool’s choice, which methods/tools are really needed?'),
(19, 1552385112, 0, 11, 7, 'The difficulty of getting the writing done! From the literature collection/management to the writing process; which tools/methods support us better, which reasons behind a method/tool’s choice, which methods/tools are really needed?'),
(20, 1552385195, 0, 12, 7, 'Thoughts in general on tools while writing:\r\n\r\n* different kinds of writing (notes, skibbeling, article writing)\r\n\r\n* several different apps to take notes'),
(21, 1552385210, 1, 12, 7, 'Thoughts in general on tools while writing:\r\n\r\n* different kinds of writing (notes, skibbeling, article writing)\r\n\r\n* several different apps to take notes'),
(22, 1552385272, 1, 13, 7, '* Drafts simple markdown (iphone) [link](https://getdrafts.com/)\r\n\r\n* nvalt (quick at hand and easy to handle) (macOS) [Link](http://brettterpstra.com/2017/09/19/nvalt-2-dot-2-8-because-i-got-high-sierra/)\r\n\r\n* fallback apps when forgetting about the tools\r\n\r\n* pomodoro technique [link](https://de.wikipedia.org/wiki/Pomodoro-Technik)\r\n\r\n* might be getting used to it after a while when using it\r\n\r\n* not for every phase of writing\r\n\r\n* coggle [link](https://coggle.it/)\r\n\r\n* paper for writing'),
(23, 1552385305, 1, 7, 7, 'List of Tools we talked about in the session:\r\n\r\nTrello (Tool): [https://trello.com/](https://trello.com/))\r\n\r\nPomodoro technique (method): [link official web page](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\nNuclino: [https://www.nuclino.com/](https://www.nuclino.com/)\r\n\r\nToby: [https://www.gettoby.com/](https://www.gettoby.com/)\r\n\r\nCitavi: [https://www.citavi.com/en](https://www.citavi.com/en)'),
(24, 1552385529, 0, 14, 7, '* gdrive\r\n\r\n* data security\r\n\r\n* not open source\r\n\r\n* sandstorm (alternative for gdrive) [link](http://www.sandstormsolution.com/)\r\n\r\n* Altlassian (which tools it?) [link](https://de.atlassian.com/)\r\n\r\n* trello\r\n\r\n* jira\r\n\r\n* mattermost (open source version of slack)\\\r\n  selfhosting or cloud hosting\\\r\n  [link](https://mattermost.com/)\r\n\r\n* Slack [link](https://slack.com/intl/de-de/)'),
(25, 1552385567, 0, 15, 7, ''),
(26, 1552385583, 0, 15, 7, 'Tools for Literature Management'),
(27, 1552385694, 0, 15, 7, 'Zotero [link](https://www.zotero.org/)\r\n\r\n* managing the texts\r\n\r\n* merging everything into tools like zotero\r\n\r\n* includes GB of full books\r\n\r\n* because open source, big support community, forum\r\n\r\n* addons\r\n\r\n* good integration\r\n\r\n* supporting many formats but not epub (e.g.)\r\n\r\n* downside is the not existent mobile app\r\n\r\n* also its ugly\r\n\r\n* structure the collection of texts in your own way\r\n\r\n* citing in writing tool is easy (at least word)\r\n\r\n* timeline function\r\n\r\n* sharing through groups is possible\r\n\r\n* but sometimes it is a privacy issue too\r\n\r\n* webdav server on sciebo (was not working?)\r\n\r\n* save th\r\n\r\n* embedding an addon (wordpress) to enable people to search through the database\r\n\r\nCitavi [link](https://www.citavi.com/de)\r\n\r\n* licence based\r\n\r\n* export is not perfect\r\n\r\n* export to zotero is possible but not the other way around\r\n\r\n* reading in citavi is possible\r\n\r\n* markings can be set in the text and have comments on it\r\n\r\n* sort the marking\r\n\r\n* there is no mac version\r\n\r\n* overkill of features'),
(28, 1552385789, 0, 10, 7, 'ASANA is another similar tool [https://asana.com/](https://asana.com/): \r\n\r\n\\- in ASANA you can assign topic directly from your email; when you register in your account you provide an email and you can link topics to it that then get upload in your ASAN board'),
(29, 1552386019, 0, 16, 7, ''),
(30, 1552386064, 0, 16, 7, ''),
(31, 1552387152, 0, 15, 7, 'Zotero [link](https://www.zotero.org/)\r\n\r\n* managing the texts\r\n\r\n* merging everything into tools like zotero\r\n\r\n* includes GB of full books\r\n\r\n* because open source, big support community, forum\r\n\r\n* addons\r\n\r\n* good integration\r\n\r\n* supporting many formats but not epub (e.g.)\r\n\r\n* downside is the not existent mobile app\r\n\r\n* also its ugly\r\n\r\n* structure the collection of texts in your own way\r\n\r\n* citing in writing tool is easy (at least word)\r\n\r\n* timeline function\r\n\r\n* sharing through groups is possible\r\n\r\n* but sometimes it is a privacy issue too\r\n\r\n* webdav server on sciebo (was not working?)\r\n\r\n* save th\r\n\r\n* embedding an addon (wordpress) to enable people to search through the database\r\n\r\nCitavi [link](https://www.citavi.com/de)\r\n\r\n* licence based\r\n\r\n* export is not perfect\r\n\r\n* export to zotero is possible but not the other way around\r\n\r\n* reading in citavi is possible\r\n\r\n* markings can be set in the text and have comments on it\r\n\r\n* sort the marking\r\n\r\n* there is no mac version\r\n\r\n* overkill of features'),
(32, 1552387197, 0, 15, 7, 'Zotero [link](https://www.zotero.org/)\r\n\r\n* managing the texts\r\n* merging everything into tools like zotero\r\n* includes GB of full books\r\n* because open source, big support community, forum\r\n* addons\r\n* good integration\r\n* supporting many formats but not epub (e.g.)\r\n* downside is the not existent mobile app\r\n* also its ugly\r\n* structure the collection of texts in your own way\r\n* citing in writing tool is easy (at least word)\r\n* timeline function\r\n* sharing through groups is possible\r\n* but sometimes it is a privacy issue too\r\n* webdav server on sciebo (was not working?)\r\n* save th\r\n* embedding an addon (wordpress) to enable people to search through the database'),
(33, 1552387229, 0, 17, 7, 'Citavi [link](https://www.citavi.com/de)\r\n\r\n* licence based\r\n* export is not perfect\r\n* export to zotero is possible but not the other way around\r\n* reading in citavi is possible\r\n* markings can be set in the text and have comments on it\r\n* sort the marking\r\n* there is no mac version\r\n* overkill of features'),
(34, 1552387326, 0, 18, 7, '[Link](https://www.maxqda.de/)\r\n\r\n* overkill of features\r\n\r\n* for large sets of data\r\n\r\n* categorize the literature after working with it in zotero\r\n\r\n* integration of all kinds of media\r\n\r\n* combination of zotero and maxqd'),
(35, 1552387396, 0, 19, 7, ''),
(36, 1552387410, 0, 19, 7, '* solves many problems of the literature management\r\n\r\n* wikimedia and wikicite also initiatives of wikipedia\r\n\r\n* backbone of the internet\r\n\r\n* interrelation of facts\r\n\r\n* make the literature work more relevant since you do not have to make it over and over again\r\n\r\n* altruistic attempt to make research more usable and search/findable in general\r\n\r\n* more or less a database of research in general'),
(37, 1552387433, 0, 14, 7, '* gdrive\r\n\r\n* data security\r\n\r\n* not open source\r\n\r\n* sandstorm (alternative for gdrive) [link](http://www.sandstormsolution.com/)\r\n\r\n* Altlassian (which tools it?) [link](https://de.atlassian.com/)\r\n\r\n* trello\r\n\r\n* jira\r\n\r\n* mattermost (open source version of slack)\\\r\n  selfhosting or cloud hosting\\\r\n  [link](https://mattermost.com/)\r\n\r\n* Slack [link](https://slack.com/intl/de-de/)'),
