(57, 1553844830, 0, 27, 7, '[link](https://gephi.org/)\r\n\r\nGephi is the leading visualization and exploration software for all kinds of graphs and networks. Gephi is open-source and free.'),
(58, 1553845495, 0, 28, 7, 'Hands on Session:\r\n\r\n* Tcat Server (Twitter Capture and Analysis Toolset)\r\n* domain is: dm1.phil.uni-siegen.de\r\n* username: tcat\r\n* pass: di6itaL\r\n* choose a fitting dataset\r\n* change data format to gdf or gexf\r\n* choose a layout (forceatlas2)\r\n* highlight those that are particularly connected\r\n* the color visualisation can be done in appearnce\r\n* rule main word out (at data laboratory)\r\n* reapply the algorithm\r\n* make the nodes readable give it labels (click T at the bottom)\r\n* adjust labels (Tt in appearence (choose size from 0.1 to 1.5) very sensitive)'),
(59, 1553845532, 0, 28, 7, 'Hands on Session:\r\n\r\n* Tcat Server (Twitter Capture and Analysis Toolset)\r\n* domain is: dm1.phil.uni-siegen.de\r\n* username: tcat\r\n* pass: di6itaL\r\n* choose a fitting dataset\r\n* change data format to gdf or gexf\r\n* choose a layout (forceatlas2)\r\n* highlight those that are particularly connected\r\n* the color visualisation can be done in appearnce\r\n* rule main word out (at data laboratory)\r\n* reapply the algorithm\r\n* make the nodes readable give it labels (click T at the bottom)\r\n* adjust labels (Tt in appearence (choose size from 0.1 to 1.5) very sensitive)'),
(60, 1553845776, 0, 16, 7, '* giving only a main idea.\r\n\r\n* struggling with basic stuff\r\n\r\n  * twitter, disruption messages, announcements (public transport)\r\n\r\n  * basic structure\r\n\r\n  * manually collecting the data (excel sheet) (time, who, to whom, hashtag, retweets\r\n\r\n* migrant networks (digital research)\r\n\r\n  * how are they connected\r\n\r\n  * what do they use to stay connected\r\n\r\n* youtube videos\r\n\r\n  * closer look to commentary section\r\n\r\n  * data scraper\r\n\r\n  * searching for a method to gather data from commentary section\r\n\r\n* multi method approach\r\n\r\n* big data talk to little data\r\n\r\n  * twitter data alongside with microanalysis of ethnographic data\r\n\r\n* looking for the right tool to\r\n\r\n* do digital methods always apply to social networks or can they be used for other stuff (pictures, exiff, drones etc)'),
(61, 1553845917, 1, 16, 7, '**Basic thoughts:**\r\n\r\n* giving only a main idea.\r\n* struggling with basic stuff\r\n  * twitter, disruption messages, announcements (public transport)\r\n  * basic structure\r\n  * manually collecting the data (excel sheet) (time, who, to whom, hashtag, retweets\r\n* migrant networks (digital research)\r\n  * how are they connected\r\n  * what do they use to stay connected\r\n* youtube videos\r\n  * closer look to commentary section\r\n  * data scraper\r\n  * searching for a method to gather data from commentary section\r\n* multi method approach\r\n* big data talk to little data\r\n  * twitter data alongside with microanalysis of ethnographic data\r\n* looking for the right tool to\r\n* do digital methods always apply to social networks or can they be used for other stuff (pictures, exiff, drones etc)\r\n\r\n**findings can be used for tool developing:**\r\n\r\n* object that is studied might need a tool to be developed for it.\r\n\r\n* frustration (because lot of tools, combination)\r\n\r\n* visualisation is hard to do\r\n\r\n* tool chaining is mandatory because many media is not only researchable with one tool\r\n\r\n* analysis and categorisation is not possible automatically but by hand'),
(62, 1553846031, 0, 22, 7, '* tool for work in facebook itself\r\n\r\n\r\n* extract data from a different facebook elements\r\n\r\n* likes posts timestamps etc can be gathered\r\n\r\n* not extract data from individuals\r\n\r\n* groups are possible but you need to be part of the group\r\n\r\n* no full names (id)\r\n\r\n* output excel files (with raw data\r\n\r\n* privacy issue'),
(63, 1553846103, 0, 22, 7, '[link](https://tools.digitalmethods.net/netvizz/facebook/netvizz/)\r\n\r\n* tool for work in facebook itself\r\n* extract data from a different facebook elements\r\n* likes posts timestamps etc can be gathered\r\n* not extract data from individuals\r\n* groups are possible but you need to be part of the group\r\n* no full names (id)\r\n* output excel files (with raw data\r\n* privacy issue'),
(64, 1553846150, 0, 23, 7, '* complex tool\r\n\r\n* on GitHub\r\n\r\n* to install on own server\r\n\r\n* huge data load might be possible\r\n\r\n* some limitations are there\r\n\r\n* no allow historical collection (because the sell it)\r\n\r\n* some workaround exist\r\n\r\n* data gathering in step two\r\n\r\n* export as csv\r\n\r\n* experimental modes exist too'),
(65, 1553846263, 0, 29, 7, '* lookout for tools\r\n\r\n* [https://tools.digitalmethods.net](https://tools.digitalmethods.net)\r\n\r\n* digital methods initiative (List of tools) digitalmethods.net\r\n\r\n* knowledge base of tools that can be used\r\n\r\n* youtube tutorials might be useful\r\n\r\n* also by digital methods.net\r\n\r\n* issue mapping online\r\n\r\n* summery ressources\r\n\r\n* method developing\r\n\r\n* medialab.science-po.fr\r\n\r\n* is another resource\r\n\r\n* now gephi.org\r\n\r\n* [https://tinyurl.com/aoir2016-digmethods](http://tinyurl.com/aoir2016-digmethods)'),
(66, 1553846580, 0, 30, 7, '* webscaper.io is one of the tool\r\n\r\n* maybe only the last possible way to get data from a webpage\r\n\r\n* always first google if there is possible api connection\r\n\r\n* scraping is the gathering of data from a common webpage\r\n\r\n* The scraper identifies elements on the webpage and maps it on different identifieres like headlines\r\n\r\n* open the web inspector (depending in the browser Crtl+ Alt + C)\r\n\r\n* with the scraper on the top right you can open a new sitemap\r\n\r\n* with the selector you can select elements that you want to select\r\n\r\n* first you need to choose what kind of source you want to gather (like links)\r\n\r\n* archiving\r\n\r\n* text in every kind of way\r\n\r\n* suggestions might be where links come from and where are they going to\r\n\r\n* it is like copy and paste it from a website just automatically and in depth'),
(67, 1553846712, 0, 31, 7, '* python scraper is a little more efficient but maybe not so easy to do by oneself\r\n\r\n* without programming skills or at least a basic vision of what you are doing it might be a bit useless\r\n\r\n[link](https://realpython.com/python-web-scraping-practical-introduction/)'),
