(84, 1553854955, 0, 28, 7, '# Hands on Session with Tcat and Gephi:\r\n\r\n* Tcat Server (Twitter Capture and Analysis Toolset)\r\n* domain is: dm1.phil.uni-siegen.de\r\n* username: tcat\r\n* pass: di6itaL\r\n* choose a fitting dataset\r\n* change data format to gdf or gexf\r\n* choose a layout (forceatlas2)\r\n* highlight those that are particularly connected\r\n* the color visualisation can be done in appearnce\r\n* rule main word out (at data laboratory)\r\n* reapply the algorithm\r\n* make the nodes readable give it labels (click T at the bottom)\r\n* adjust labels (Tt in appearence (choose size from 0.1 to 1.5) very sensitive)'),
(85, 1553855004, 0, 32, 10, '## Bear - [https://bear.app/](https://bear.app/)\r\n\r\n**Whom: Only for Mac users!**\r\n\r\n**What?** \r\n\r\n* Bear works on iPhone, iPad, and Mac, so you can write wherever inspiration strikes!\r\n* Wonderful for **todos list organisations** to stay on task across every device.\r\n* Link notes to each other to build a body of work.\r\n* Use hashtags to organize for the way you think.\r\n* All notes are stored in portable plain text.\r\n* Bear Pro offer advanced features, including sync between all your devices, over a dozen beautiful themes, and more powerful export options. All this, and future Pro features, can be unlocked with a single in-app subscription that covers all your devices.\r\n\r\n  **How much: Very cheap Pro subscription**:\r\n  * $1.49 monthly, which offers a one week free trial\r\n  * $14.99 annually, which has a one month free trial\r\n\r\n![Bear.png](file-guid:8f7960f1-3b50-4e05-b950-9cefab9dbdd3 \"Bear.png\")'),
(86, 1553855278, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!** \r\n\r\n**What:** \r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")\r\n\r\n**How much:** \r\n\r\n![Asana - price.png](file-guid:bbcf6960-28cc-4955-9d93-a87be26f5efd \"Asana - price.png\")'),
(87, 1553855333, 0, 21, 7, '# Gephi - [https://gephi.org/features/](https://gephi.org/features/)\r\n\r\nGephi is a tool for data analysts and scientists keen to explore and understand graphs. Like Photoshop but for graph data, the user interacts with the representation, manipulate the structures, shapes and colors to reveal hidden patterns. \r\n\r\nThe goal is to help data analysts to make hypothesis, intuitively discover patterns, isolate structure singularities or faults during data sourcing. It is a complementary tool to traditional statistics, as visual thinking with interactive interfaces is now recognized to facilitate [reasoning](http://www.cs.umd.edu/hcil/pubs/books/readings-info-vis.shtml). \r\n\r\nThis is a software for [Exploratory Data Analysis](http://en.wikipedia.org/wiki/Exploratory_data_analysis), a paradigm appeared in the [Visual Analytics](http://en.wikipedia.org/wiki/Visual_Analytics) field of research.'),
(88, 1553855364, 0, 21, 7, '# Gephi - [https://gephi.org/features/](https://gephi.org/features/)\r\n\r\nGephi is a tool for data analysts and scientists keen to explore and understand graphs. Like Photoshop but for graph data, the user interacts with the representation, manipulate the structures, shapes and colors to reveal hidden patterns. \r\n\r\nThe goal is to help data analysts to make hypothesis, intuitively discover patterns, isolate structure singularities or faults during data sourcing. It is a complementary tool to traditional statistics, as visual thinking with interactive interfaces is now recognized to facilitate [reasoning](http://www.cs.umd.edu/hcil/pubs/books/readings-info-vis.shtml). \r\n\r\nThis is a software for [Exploratory Data Analysis](http://en.wikipedia.org/wiki/Exploratory_data_analysis), a paradigm appeared in the [Visual Analytics](http://en.wikipedia.org/wiki/Visual_Analytics) field of research.'),
(89, 1553855391, 1, 22, 7, '# Facebook Netvizz - [https://tools.digitalmethods.net/](https://tools.digitalmethods.net/netvizz/facebook/netvizz/)\r\n\r\n* tool for work in facebook itself\r\n* extract data from a different facebook elements\r\n* likes posts timestamps etc can be gathered\r\n* not extract data from individuals\r\n* groups are possible but you need to be part of the group\r\n* no full names (id)\r\n* output excel files (with raw data\r\n* privacy issue'),
(90, 1553855395, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")'),
(91, 1553855478, 1, 21, 7, '# Gephi - [https://gephi.org/features/](https://gephi.org/features/)\r\n\r\nGephi is a tool for data analysts and scientists keen to explore and understand graphs. Like Photoshop but for graph data, the user interacts with the representation, manipulate the structures, shapes and colors to reveal hidden patterns.\r\n\r\nThe goal is to help data analysts to make hypothesis, intuitively discover patterns, isolate structure singularities or faults during data sourcing. It is a complementary tool to traditional statistics, as visual thinking with interactive interfaces is now recognized to facilitate [reasoning](http://www.cs.umd.edu/hcil/pubs/books/readings-info-vis.shtml).\r\n\r\nThis is a software for [Exploratory Data Analysis](http://en.wikipedia.org/wiki/Exploratory_data_analysis), a paradigm appeared in the [Visual Analytics](http://en.wikipedia.org/wiki/Visual_Analytics) field of research.\r\n\r\n![image.png](file-guid:f25d7445-eb59-4752-ba4e-3e24ff10c975 \"image.png\")'),
(92, 1553855541, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place;\r\n* Use **Timeline to create a plan** that shows you how the pieces of your project fit together, and helps you **keep work on track as things change**;\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")'),
