(95, 1553855822, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place;\r\n* Use **Timeline to create a plan** that shows you how the pieces of your project fit together, and helps you **keep work on track as things change**;\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")\r\n\r\n> Nico can you join next week on the 3rd April at 11.30-12.30 instead 13.00-14.00? (if you are on vacation you can also reply some other time!) For you to know, we moved the meeting at 11.30-12.30!'),
(96, 1554199646, 1, 33, 7, 'Need everyday practice\r\n\r\n* sensitive data from partners\r\n\r\n* need to be anonymised\r\n\r\n* collaborating on papers is hard to do\r\n\r\n* no cloud server\r\n\r\n* where is the critical part of the data\r\n\r\nSometime a little hard to contain encryption when forwarding emails'),
(97, 1554199716, 1, 34, 7, '# Tactical Toolbox - [https://tacticaltech.org/](https://tacticaltech.org/)\r\n\r\nguidelines for activists is collected in a toolbox\r\n\r\n* tactical tech is that toolbox\r\n\r\n* [https://tacticaltech.org/](https://tacticaltech.org/)\r\n\r\n* suggestions on how to deal with critical data\r\n\r\n* key project is: [https://tacticaltech.org/projects/security-in-a-box-key-project/](https://tacticaltech.org/projects/security-in-a-box-key-project/)'),
(98, 1554200814, 1, 35, 7, 'Dropbox:\r\n\r\n* not encrypted\r\n* documents where written\r\n* dropbox\r\n* flat Level of awareness of secuity\r\n* not everyone had access to everything\r\n* where is the dropbox been held? US Server\r\n* was everyone fine with it? \r\n* everyone was fine with it at the start\r\n\r\nserver structure of sciebo\r\n\r\n* platform itself is not encrypted\r\n\r\n* data on it should be encrypted - you have to encrypt it yourself'),
(99, 1554201022, 0, 36, 7, '# Discussion about the pro and cons of anonymization\r\n\r\n* are names and all infos important for the analysis?\r\n\r\n* blur sometimes does not reach the right security level ( characters are still countable)\r\n\r\n  * telling a story in a paper is easier with name (even pseudo names)\r\n\r\n\r\n* table of fake names (gender, name, etc)\r\n\r\n  * in data collection kind of data is important.'),
(100, 1554201115, 0, 37, 7, '# General thought from the practice on holding interviews\r\n\r\n* something inofficial is been told not in interview\r\n\r\n  * what can i do with this information\r\n\r\n  * partner does not want me to write it down\r\n\r\n  * maybe a persona (might be to weird)\r\n\r\n  * field notes hard to work with when striped from feelings\r\n\r\n* some don’t trust reseachers\r\n\r\n* ethically usage of these data is not possible\r\n\r\n* refuse of the partner to use the data\r\n\r\n* eliminate influences of these informations on your writing is not possible\r\n\r\n* good academic practice\r\n\r\n  * protection of sources\r\n\r\n* there is no real solution of it\r\n\r\n* your mind is always shaped by people telling you stuff'),
(101, 1554201206, 1, 37, 7, '# General thought from the practice on holding interviews\r\n\r\n* something unofficial is been told not in interview\r\n  * what can i do with this information\r\n  * partner does not want me to write it down\r\n  * maybe a persona (might be to weird)\r\n  * field notes hard to work with when striped from feelings\r\n\r\n## Trust issues:\r\n\r\n* some don’t trust researchers\r\n* ethically usage of these data is not possible\r\n* refuse of the partner to use the data\r\n* good academic practice\r\n  * protection of sources\r\n\r\n## Influences while interviewing:\r\n\r\n* eliminate influences of these informations on your writing is not possible\r\n* there is no real solution for it\r\n* your mind is always shaped by people telling you stuff'),
(102, 1554205476, 0, 20, 10, '## **Nuclino: [https://www.nuclino.com/](https://www.nuclino.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Organise your notes and team’s knowledge in one place\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Standard: $5/user/month\r\n* Premium: $10/user/month\r\n\r\n![Nuclino.png](file-guid:076619b0-307f-4dd7-8d07-298d5a6d5c1c \"Nuclino.png\")'),
(103, 1554205506, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place;\r\n* Use **Timeline to create a plan** that shows you how the pieces of your project fit together, and helps you **keep work on track as things change**;\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")'),
(104, 1554205537, 0, 10, 10, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place;\r\n* Use **Timeline to create a plan** that shows you how the pieces of your project fit together, and helps you **keep work on track as things change**;\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")'),
(105, 1554205569, 1, 32, 10, '## Bear - [https://bear.app/](https://bear.app/)\r\n\r\n**Whom: Only for Mac users!**\r\n\r\n**What?** \r\n\r\n* Bear works on iPhone, iPad, and Mac, so you can write wherever inspiration strikes!\r\n* Wonderful for **todos list organisations** to stay on task across every device.\r\n* Link notes to each other to build a body of work.\r\n* Use hashtags to organize for the way you think.\r\n* All notes are stored in portable plain text.\r\n* Bear Pro offer advanced features, including sync between all your devices, over a dozen beautiful themes, and more powerful export options. All this, and future Pro features, can be unlocked with a single in-app subscription that covers all your devices.\r\n\r\n  **How much: Very cheap Pro subscription**:\r\n  * $1.49 monthly, which offers a one week free trial\r\n  * $14.99 annually, which has a one month free trial\r\n\r\n![Bear.png](file-guid:8f7960f1-3b50-4e05-b950-9cefab9dbdd3 \"Bear.png\")'),
(106, 1554205606, 1, 20, 10, '## **Nuclino: [https://www.nuclino.com/](https://www.nuclino.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Organise your notes and team’s knowledge in one place\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Standard: $5/user/month\r\n* Premium: $10/user/month\r\n\r\n![Nuclino.png](file-guid:076619b0-307f-4dd7-8d07-298d5a6d5c1c \"Nuclino.png\")'),
(107, 1554205836, 1, 9, 10, '## **Toby: [http://www.gettoby.com/](http://www.gettoby.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Bookmarks organizers!! Wonderful tool!\r\n* \"Bookmarks are for books, not browsers. Organize your browser tabs into Toby so you can access key resources in one click instead of seven”\r\n\r\n**How much:**\r\n\r\n* Free!\r\n\r\n![Toby.png](file-guid:2e2d8291-8799-47c2-8568-5c54418bad20 \"Toby.png\")'),
(108, 1554206427, 0, 8, 10, '## **Trello: [https://trello.com/](https://trello.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Trello is a collaboration tool that organizes your projects into boards. In one glance, Trello tells you what\'s being worked on, who\'s working on what, and where something is in a process.\r\n* Imagine a white board, filled with lists of sticky notes, with each note as a task for you and your team. Now imagine that each of those sticky notes has photos, attachments from other data sources like BitBucket or Salesforce, documents, and a place to comment and collaborate with your teammates. Now imagine that you can take that whiteboard anywhere you go on your smartphone, and can access it from any computer through the web. That\'s Trello!\r\n\r\n**How much:**\r\n\r\n* Mainly free!\r\n\r\n![Trello.jpg](file-guid:9e87b906-a4b0-4328-ac03-8ec023e13b4b \"Trello.jpg\")'),
(109, 1554206449, 0, 8, 10, '## **Trello: [https://trello.com/](https://trello.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Trello is a collaboration tool that organizes your projects into boards. In one glance, Trello tells you what\'s being worked on, who\'s working on what, and where something is in a process.\r\n* Imagine a white board, filled with lists of sticky notes, with each note as a task for you and your team. Now imagine that each of those sticky notes has photos, attachments from other data sources like BitBucket or Salesforce, documents, and a place to comment and collaborate with your teammates. Now imagine that you can take that whiteboard anywhere you go on your smartphone, and can access it from any computer through the web. That\'s Trello!\r\n\r\n**How much:**\r\n\r\n* Mainly free!\r\n\r\n![Trello.jpg](file-guid:9e87b906-a4b0-4328-ac03-8ec023e13b4b \"Trello.jpg\")\r\n\r\n> \"Trello is helpful to work with other and have the processual way of what is going on, you can assign color and tasks which is helpful but it is not very helpful to support my research work that is mostly based in written notes, therefore I have a lot of \"dead notes\" (notes i don\'t need anymore), it is very difficult to organize and to understand what is really helpful and what I can let go \"'),
(110, 1554206488, 0, 8, 10, '## **Trello: [https://trello.com/](https://trello.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Trello is a collaboration tool that organizes your projects into boards. In one glance, Trello tells you what\'s being worked on, who\'s working on what, and where something is in a process.\r\n* Imagine a white board, filled with lists of sticky notes, with each note as a task for you and your team. Now imagine that each of those sticky notes has photos, attachments from other data sources like BitBucket or Salesforce, documents, and a place to comment and collaborate with your teammates. Now imagine that you can take that whiteboard anywhere you go on your smartphone, and can access it from any computer through the web. That\'s Trello!\r\n\r\n**How much:**\r\n\r\n* Mainly free!\r\n\r\n![Trello.jpg](file-guid:9e87b906-a4b0-4328-ac03-8ec023e13b4b \"Trello.jpg\")\r\n\r\n> \"Trello is helpful to work with other and have the processual way of what is going on, you can assign color and tasks which is helpful but it is not very helpful to support my research work that is mostly based in written notes, therefore I have a lot of \"dead notes\" (notes i don\'t need anymore), it is very difficult to organize and to understand what is really helpful and what I can let go \"\r\n\r\n> “Kanban board is the inspiration model behind Trello, you can check a video on youtube here: [Kanban video](https://www.youtube.com/watch?v=N3BoLRVXoI0)”'),
(111, 1554206519, 1, 8, 10, '## **Trello: [https://trello.com/](https://trello.com/)**\r\n\r\n**Whom:** everyone!\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Trello is a collaboration tool that organizes your projects into boards. In one glance, Trello tells you what\'s being worked on, who\'s working on what, and where something is in a process.\r\n* Imagine a white board, filled with lists of sticky notes, with each note as a task for you and your team. Now imagine that each of those sticky notes has photos, attachments from other data sources like BitBucket or Salesforce, documents, and a place to comment and collaborate with your teammates. Now imagine that you can take that whiteboard anywhere you go on your smartphone, and can access it from any computer through the web. That\'s Trello!\r\n* **Kanban board is the inspiration model behind Trello,** you can check a video on youtube here: [Kanban video](https://www.youtube.com/watch?v=N3BoLRVXoI0)\r\n\r\n**How much:**\r\n\r\n* Mainly free!\r\n\r\n![Trello.jpg](file-guid:9e87b906-a4b0-4328-ac03-8ec023e13b4b \"Trello.jpg\")\r\n\r\n> \"Trello is helpful to work with other and have the processual way of what is going on, you can assign color and tasks which is helpful but it is not very helpful to support my research work that is mostly based in written notes, therefore I have a lot of \"dead notes\" (notes i don\'t need anymore), it is very difficult to organize and to understand what is really helpful and what I can let go \"'),
(112, 1554206642, 0, 38, 10, '## Pomodoro technique: [https://francescocirillo.com/pages/pomodoro-technique](https://francescocirillo.com/pages/pomodoro-technique)');
INSERT INTO `wiki_page_revision` (`id`, `revision`, `is_latest`, `wiki_page_id`, `user_id`, `content`) VALUES
(113, 1554206713, 0, 38, 10, '## Pomodoro: [https://francescocirillo.com/pages/pomodoro-technique](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\n#### 1. Choose a task you\'d like to get done\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_1.png?985)\r\n\r\nSomething big, something small, something you’ve been putting off for a million years: it doesn’t matter. What matters is that it’s something that deserves your full, undivided attention.\r\n\r\n---\r\n\r\n#### 2. Set the Pomodoro for 25 minutes\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_2.png?985)\r\n\r\nMake a small oath to yourself: I will spend 25 minutes on this task and I will not interrupt myself. You can do it! After all, it’s just 25 minutes.\r\n\r\n---\r\n\r\n#### 3. Work on the task until the Pomodoro rings\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_3.png?985)\r\n\r\nImmerse yourself in the task for the next 25 minutes. If you suddenly realize you have something else you need to do, write the task down on a sheet of paper.\r\n\r\n---\r\n\r\n#### 4. When the Pomodoro rings, put a checkmark on a paper\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_4.png?985)\r\n\r\nCongratulations! You’ve spent an entire, interruption-less Pomodoro on a task.\r\n\r\n---\r\n\r\n#### 5. Take a short break on a paper\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_5.png?985)\r\n\r\nBreathe, meditate, grab a cup of coffee, go for a short walk or do something else relaxing (i.e., not work-related). Your brain will thank you later.\r\n\r\n---\r\n\r\n#### 6. Every 4 pomodoros, take a longer break on a paper'),
(114, 1554206788, 0, 38, 10, '## Pomodoro: [https://francescocirillo.com/pages/pomodoro-technique](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\n#### **1. Choose a task you\'d like to get done**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_1.png?985)\r\n\r\nSomething big, something small, something you’ve been putting off for a million years: it doesn’t matter. What matters is that it’s something that deserves your full, undivided attention.\r\n\r\n---\r\n\r\n#### **2. Set the Pomodoro for 25 minutes**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_2.png?985)\r\n\r\nMake a small oath to yourself: I will spend 25 minutes on this task and I will not interrupt myself. You can do it! After all, it’s just 25 minutes.\r\n\r\n---\r\n\r\n#### **3. Work on the task until the Pomodoro rings**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_3.png?985)\r\n\r\nImmerse yourself in the task for the next 25 minutes. If you suddenly realize you have something else you need to do, write the task down on a sheet of paper.\r\n\r\n---\r\n\r\n#### **4. When the Pomodoro rings, put a checkmark on a paper**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_4.png?985)\r\n\r\nCongratulations! You’ve spent an entire, interruption-less Pomodoro on a task.\r\n\r\n---\r\n\r\n#### **5. Take a short break on a paper**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_5.png?985)\r\n\r\nBreathe, meditate, grab a cup of coffee, go for a short walk or do something else relaxing (i.e., not work-related). Your brain will thank you later.\r\n\r\n---\r\n\r\n#### **6. Every 4 pomodoros, take a longer break on a paper**'),
(115, 1554206827, 1, 38, 10, '## Pomodoro: [https://francescocirillo.com/pages/pomodoro-technique](https://francescocirillo.com/pages/pomodoro-technique)\r\n\r\nThe sequence of this technique: \r\n\r\n#### **1. Choose a task you\'d like to get done**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_1.png?985)\r\n\r\nSomething big, something small, something you’ve been putting off for a million years: it doesn’t matter. What matters is that it’s something that deserves your full, undivided attention.\r\n\r\n---\r\n\r\n#### **2. Set the Pomodoro for 25 minutes**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_2.png?985)\r\n\r\nMake a small oath to yourself: I will spend 25 minutes on this task and I will not interrupt myself. You can do it! After all, it’s just 25 minutes.\r\n\r\n---\r\n\r\n#### **3. Work on the task until the Pomodoro rings**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_3.png?985)\r\n\r\nImmerse yourself in the task for the next 25 minutes. If you suddenly realize you have something else you need to do, write the task down on a sheet of paper.\r\n\r\n---\r\n\r\n#### **4. When the Pomodoro rings, put a checkmark on a paper**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_4.png?985)\r\n\r\nCongratulations! You’ve spent an entire, interruption-less Pomodoro on a task.\r\n\r\n---\r\n\r\n#### **5. Take a short break on a paper**\r\n\r\n![](https://cdn.shopify.com/s/files/1/0257/1675/t/152/assets/how_5.png?985)\r\n\r\nBreathe, meditate, grab a cup of coffee, go for a short walk or do something else relaxing (i.e., not work-related). Your brain will thank you later.\r\n\r\n---\r\n\r\n#### **6. Every 4 pomodoros, take a longer break on a paper**'),
(116, 1554209114, 0, 18, 10, '## **Maxqda: [https://www.maxqda.com/](https://www.maxqda.com/)**\r\n\r\n**Whom: everyone but you need a license!** \r\n\r\n**What:** \r\n\r\n* Qualitative data analysis tool \r\n* overkill of features\r\n* for large sets of data\r\n* categorize the literature after working with it in zotero\r\n* integration of all kinds of media\r\n* combination of zotero and maxqa\r\n\r\n**How much:** \r\n\r\n* you can check licenses here: [https://www.maxqda.com/licenses](https://www.maxqda.com/licenses)\r\n\r\n![Maxqda.png](file-guid:613e98c8-6ad4-4691-9af9-801fd2c34238 \"Maxqda.png\")'),
(117, 1554209230, 0, 15, 10, '## **Zotero: [https://www.zotero.org/](https://www.zotero.org/)**\r\n\r\n* managing the texts\r\n* merging everything into tools like zotero\r\n* includes GB of full books\r\n* because open source, big support community, forum\r\n* addons\r\n* good integration\r\n* supporting many formats but not epub (e.g.)\r\n* downside is the not existent mobile app\r\n* also its ugly\r\n* structure the collection of texts in your own way\r\n* citing in writing tool is easy (at least word)\r\n* timeline function\r\n* sharing through groups is possible\r\n* but sometimes it is a privacy issue too\r\n* webdav server on sciebo (was not working?)\r\n* save th\r\n* embedding an addon (wordpress) to enable people to search through the database\r\n\r\n![zotero.png](file-guid:9b4f4a1c-c411-46cc-86f8-8a46a985cbe9 \"zotero.png\")'),
(118, 1554209471, 0, 17, 10, '## **Citavi: [https://www.citavi.com/en](https://www.citavi.com/en)**\r\n\r\n**Whom: only windows - licence based**\r\n\r\n**What:** \r\n\r\n* export is not perfect\r\n* export to zotero is possible but not the other way around\r\n* reading in citavi is possible\r\n* markings can be set in the text and have comments on it\r\n* sort the marking\r\n* there is no mac version\r\n* overkill of features\r\n\r\n![Citavi-1440600120-0-0.jpg](file-guid:f3d40496-14f9-4b92-a66f-000565cf3e73 \"Citavi-1440600120-0-0.jpg\")'),
(119, 1554284425, 0, 27, 7, '[link](https://gephi.org/)\r\n\r\nGephi is the leading visualization and exploration software for all kinds of graphs and networks. Gephi is open-source and free.'),
(120, 1554284437, 0, 31, 7, '# Python Scraper - [https://realpython.com/](https://realpython.com/python-web-scraping-practical-introduction/)\r\n\r\n* python scraper is a little more efficient but maybe not so easy to do by oneself\r\n* without programming skills or at least a basic vision of what you are doing it might be a bit useless'),
(121, 1554284447, 1, 28, 7, '# Hands on Session with Tcat and Gephi:\r\n\r\n* Tcat Server (Twitter Capture and Analysis Toolset)\r\n* domain is: dm1.phil.uni-siegen.de\r\n* username: tcat\r\n* pass: di6itaL\r\n* choose a fitting dataset\r\n* change data format to gdf or gexf\r\n* choose a layout (forceatlas2)\r\n* highlight those that are particularly connected\r\n* the color visualisation can be done in appearnce\r\n* rule main word out (at data laboratory)\r\n* reapply the algorithm\r\n* make the nodes readable give it labels (click T at the bottom)\r\n* adjust labels (Tt in appearence (choose size from 0.1 to 1.5) very sensitive)'),
(122, 1554284461, 1, 30, 7, '# Webscraper.io - [https://www.webscraper.io/](https://www.webscraper.io/)\r\n\r\n* webscaper.io is one of the tool\r\n* maybe only the last possible way to get data from a webpage\r\n* always first google if there is possible api connection\r\n* scraping is the gathering of data from a common webpage\r\n* The scraper identifies elements on the webpage and maps it on different identifiers like headlines\r\n* open the web inspector (depending in the browser Ctrl+ Alt + C)\r\n* with the scraper on the top right you can open a new sitemap\r\n* with the selector you can select elements that you want to select\r\n* first you need to choose what kind of source you want to gather (like links)\r\n* archiving\r\n* text in every kind of way\r\n* suggestions might be where links come from and where are they going to\r\n* it is like copy and paste it from a website just automatically and in depth'),
(123, 1554807807, 1, 1, 7, 'In this topic, we will discuss tools and methods issues related to:\r\n\r\n* productivity, time management, project management, self-work management; etc... everything you might think of that support the best (or the worst) your work in everyday achievements!'),
(124, 1554807819, 1, 11, 7, 'The difficulty of getting the writing done! From the literature collection/management to the writing process; which tools/methods support us better, which reasons behind a method/tool’s choice, which methods/tools are really needed?'),
(125, 1554807829, 1, 3, 7, 'Collection of common challenges/topics from the group.\r\n\r\nOpen discussion about (virtual) ethnography and qualitative data analysis.'),
(126, 1554807843, 1, 2, 7, 'Digital methods, approaches to tool development and briefly introduce a couple of key tools - where to find them and where documentation exists. Discussion on needs and to find out what the participants are interested in.'),
(127, 1554807855, 1, 26, 7, ''),
(128, 1554807873, 1, 39, 7, ''),
(129, 1554807977, 0, 40, 7, '* After the intro, we will explore the first topic *“Time management and organizing workflow”*. We will dig more into the issue of productivity, time management, workflow and explore possible best practices.\r\n\r\n  * Timo Kaerlein will show how the CRC coordination is using Trello to support their work;\r\n\r\n  * Gaia Mosconi will show a tool called “Bear” and “Nuclino” both already mentioned in WiSe 2018 but not explored in details.\r\n\r\n  * We invite all of you to show us what works for you the best but also what are your major struggles concerning time management, workflow, and productivity.'),
(130, 1554808126, 0, 41, 7, '* keywords\r\n\r\n  * self discipline\r\n\r\n* fit the tools to the tasks you are doing\r\n\r\n* pomodoro technique is explained\r\n\r\n  * you read about in the teclabs wiki: [http://tinyurl.com/y6gbgpat](http://tinyurl.com/y6gbgpat)\r\n\r\n  * there is a browser app\r\n\r\n  * phone apps are also available\r\n\r\n* bear - notes tool - [https://bear.app/](https://bear.app/)\r\n\r\n  * [https://bear.app/](https://bear.app/)\r\n\r\n  * helped not getting lost in the process\r\n\r\n  * no notifications so far\r\n\r\n  * since it is a note taking tool the notifications are not planned\r\n\r\n* do not use to many tools'),
(131, 1554808183, 0, 41, 7, '# Main keyword is - self discipline\r\n\r\n* fit the tools to the tasks you are doing\r\n* pomodoro technique\r\n  * you read about in the teclabs wiki: [http://tinyurl.com/y6gbgpat](http://tinyurl.com/y6gbgpat)\r\n  * there is a browser app\r\n  * phone apps are also available\r\n* bear - notes tool - [https://bear.app/](https://bear.app/)\r\n  * [https://bear.app/](https://bear.app/)\r\n  * helped not getting lost in the process\r\n  * no notifications so far\r\n  * since it is a note taking tool the notifications are not planned\r\n* do not use to many tools'),
(132, 1554808435, 0, 42, 7, '# Trello - [https://trello.com/](https://trello.com/)\r\n\r\n* features are fixable to the task at hand.\r\n\r\n* team management\r\n\r\n* group workflow management\r\n\r\n* lean management tool\r\n\r\n* post-it like\r\n\r\n* open source solutions weaken\r\n\r\n* three main elements\r\n\r\n  * boards\r\n\r\n    * boards are only useful if working in groups\r\n\r\n  * lists\r\n\r\n    * lists inhabit the cards that are the tasks itself\r\n\r\n  * cards\r\n\r\n    * to do, doing, review, done are possible lists to start with\r\n\r\n    * but it is you to know what is fitting for your project\r\n\r\n    * just move the cards to another status to give it another status\r\n\r\n    * very satisfying\r\n\r\n    * review is a channel where the people look after the mostly done topics\r\n\r\n    * detail task view\r\n\r\n      * management of the people that are assigned to the task\r\n\r\n      * insistence can be communicated well\r\n\r\n      * checklist in the tasks view holds the detailed tasks that are at hand\r\n\r\n    * discussions can be held in the card itself to discuss about the ongoing work\r\n\r\n    * labels make the tasks more visible and can categorize the task\r\n\r\n    * recurring tasks can not be done - just by moving the card back to todo\r\n\r\n    * feeling of control\r\n\r\n    * comment section is powerful\r\n\r\n      * mentioning people\r\n\r\n      * notification is sent out\r\n\r\n    * not for one alone\r\n\r\n      * no benefit in just using lists, word etc.\r\n\r\n    * attachment is a powerful tool too to create an archive\r\n\r\n    * main benefit: VERY FAST\r\n\r\n      * easy to use\r\n\r\n      * store everything somewhere\r\n\r\n      * cards can be linked to other cards (refereeing)\r\n\r\n      * dump everything in the card to make a log of everything in there'),
(133, 1554808644, 0, 43, 7, '# Omnifocus - [https://www.omnigroup.com/omnifocus](https://www.omnigroup.com/omnifocus)\r\n\r\n* there is an iPad and iPhone App\r\n\r\n* folder wise categorization of tasks\r\n\r\n* projects of the things to do (main task)\r\n\r\n* actions are singe todos in a project\r\n\r\n* context: is the place where it happens\r\n\r\n* omnifocus makes an email address for you and lets you sync the mail in ominfocus with ALL attentions\r\n\r\n* iPhone can be used with siri to make actions\r\n\r\n* set a time in the week to tidy up you inbox\r\n\r\n* design is really flat and no domination of some points\r\n\r\n![Omnifocus_1.png](file-guid:fe5d7fbb-004f-4dee-a3c6-d2feffda42db \"Omnifocus_1.png\")![Omnifocus_2.png](file-guid:bca833fe-cdc8-45dd-96d7-8556c1a60a27 \"Omnifocus_2.png\")'),
(134, 1554808816, 0, 43, 7, '# Omnifocus - [https://www.omnigroup.com/omnifocus](https://www.omnigroup.com/omnifocus)\r\n\r\n**For whom:**\r\n\r\n* Mac users\r\n* everyone who has many Projects\r\n\r\n**What:**\r\n\r\n* there is an iPad and iPhone App\r\n* folder wise categorization of tasks\r\n* projects of the things to do (main task)\r\n* actions are singe todos in a project\r\n* context: is the place where it happens\r\n* omnifocus makes an email address for you and lets you sync the mail in omnifocus with ALL attentions\r\n* iPhone can be used with SIRI to make actions\r\n* set a time in the week to tidy up you inbox\r\n* design is really flat and no domination of some points\r\n\r\n**How much:**\r\n\r\n* OmniFocus 3 License - $49.99 USD\r\n* OmniFocus 3 Pro License - $99.99 USD\r\n\r\n![Omnifocus](file-guid:fe5d7fbb-004f-4dee-a3c6-d2feffda42db \"Omnifocus_1.png\")![Omnifocus](file-guid:bca833fe-cdc8-45dd-96d7-8556c1a60a27 \"Omnifocus_2.png\")'),
(135, 1554808843, 1, 43, 7, '# Omnifocus - [https://www.omnigroup.com/omnifocus](https://www.omnigroup.com/omnifocus)\r\n\r\n**For whom:**\r\n\r\n* Mac users\r\n* everyone who has many Projects\r\n\r\n**What:**\r\n\r\n* there is an iPad and iPhone App\r\n* folder wise categorization of tasks\r\n* projects of the things to do (main task)\r\n* actions are singe todos in a project\r\n* context: is the place where it happens\r\n* omnifocus makes an email address for you and lets you sync the mail in omnifocus with ALL attentions\r\n* iPhone can be used with SIRI to make actions\r\n* set a time in the week to tidy up you inbox\r\n* design is really flat and no domination of some points\r\n\r\n**How much:**\r\n\r\n* OmniFocus 3 License - $49.99 USD\r\n* OmniFocus 3 Pro License - $99.99 USD\r\n\r\n![Omnifocus](file-guid:fe5d7fbb-004f-4dee-a3c6-d2feffda42db \"Omnifocus_1.png\")![Omnifocus](file-guid:bca833fe-cdc8-45dd-96d7-8556c1a60a27 \"Omnifocus_2.png\")'),
(136, 1554809056, 1, 42, 7, '# Trello - [https://trello.com/](https://trello.com/)\r\n\r\n**For Whom:**\r\n\r\n* Everyone\r\n\r\n**What:**\r\n\r\n* features are fixable to the task at hand.\r\n* team management\r\n* group workflow management\r\n* lean management tool\r\n* post-it like\r\n* open source solutions weaken\r\n* three main elements\r\n  * boards\r\n    * boards are only useful if working in groups\r\n  * lists\r\n    * lists inhabit the cards that are the tasks itself\r\n  * cards\r\n    * to do, doing, review, done are possible lists to start with\r\n    * but it is you to know what is fitting for your project\r\n    * just move the cards to another status to give it another status\r\n    * very satisfying\r\n    * review is a channel where the people look after the mostly done topics\r\n    * detail task view\r\n      * management of the people that are assigned to the task\r\n      * insistence can be communicated well\r\n      * checklist in the tasks view holds the detailed tasks that are at hand\r\n    * discussions can be held in the card itself to discuss about the ongoing work\r\n    * labels make the tasks more visible and can categorize the task\r\n    * recurring tasks can not be done - just by moving the card back to todo\r\n    * feeling of control\r\n    * comment section is powerful\r\n      * mentioning people\r\n      * notification is sent out\r\n    * not for one alone\r\n      * no benefit in just using lists, word etc.\r\n    * attachment is a powerful tool too to create an archive\r\n    * main benefit: VERY FAST\r\n      * easy to use\r\n      * store everything somewhere\r\n      * cards can be linked to other cards (refereeing)\r\n      * dump everything in the card to make a log of everything in there\r\n\r\n**How much:**\r\n\r\n* Free\r\n\r\n![Trello_1.png](file-guid:f516d3b1-ed46-4578-afca-618d75646507 \"Trello_1.png\")![Trello_2.png](file-guid:8aebff18-d4f0-4336-a1ea-a31a0f5ba891 \"Trello_2.png\")![Trello_3.png](file-guid:b76b39e9-5f3f-4c5d-a835-09e5a7cd4bc4 \"Trello_3.png\")'),
