(157, 1560933562, 0, 50, 7, '### Presentation of Helena Krasti about the work in the field work\r\n\r\n### **Points are:**\r\n\r\n* Ethical conduct\r\n\r\n* Reflexibility\r\n\r\n* Postionality\r\n\r\n  * how you position yourself in an environment\r\n\r\n  * age, sexuality etc matters in that kind of things\r\n\r\n\r\n* Emotional work\r\n\r\n  * systematic self reflexivity is important throughout the whole process\r\n\r\n**Keep in mind:**\r\n\r\n* Ethnics is about the people you are studying on and with\r\n\r\n* its a trust situation\r\n\r\n* ethics are the most important part\r\n\r\n* you can not predict what happens and what you will see\r\n\r\n* country have different ethical foundations to keep in mind\r\n\r\n**Experiences:**\r\n\r\nWhat might evolve when working with and in Ethnography?\r\n\r\n* not being able to put thought together\r\n\r\n* depression\r\n\r\n* social connection while being depressed is a huge step - sharing the problem with others\r\n\r\n* lot of us can’t do that\r\n\r\n* writing progress can be blockend by insecurities about the research itself\r\n\r\n* ask for feedback is a huge step too\r\n\r\n**Situation in the UK**\r\n\r\n* in the uk the institute is more protected than the relationship between the interviewer - interviewee\r\n\r\n* so more researcher -> institute\r\n\r\n* sometime the interests between the object of research and the institute is a clash of interests\r\n\r\n* public space is borderline issue\r\n\r\n* guidelines of the police monitoring people is a best practice to follow\r\n\r\n* blurring faces is a practice\r\n\r\n**Filming children**\r\n\r\n* data only for research afterwards get it back to the people\r\n\r\n* parents said yes to filming\r\n\r\n* no publishing of the material\r\n\r\n* teenager 12-14 is the same situation\r\n\r\n* archiving the data can be good for the further career\r\n\r\n* what you say and what you do are sometimes different processes\r\n\r\n* long term research projects need the data for reuse\r\n\r\nEthnographic research analysis is not a phase but it goes through the whole research\r\n\r\n* iterative\r\n\r\n* data is not the problem but having to much is a problem\r\n\r\n* watching data with the interviewee together can be deliberating and gives a view from another poi'),
