(170, 1560934936, 0, 56, 7, 'This meeting was quite different since the speakers came from all over the world to talk to us about their experiences on digital methods.\r\n\r\n1. Ken Carroll (Netherlands) presentation on BUMP “Big Unsolved Meaningful Problems Worth Solving”\r\n2. James Gien Wong (South Africa) presentation of planetary boundaries, related approaches, and plans;\r\n3. Michael - presentation about Kumu.io for visualizing data'),
(171, 1560934943, 0, 57, 25, ''),
(172, 1560935245, 0, 58, 7, '**Webpage: [https://bumps.world/](https://bumps.world/)**\r\n\r\n**Person:**\r\n\r\n* Ken Carrol\r\n\r\n* living in netherland\r\n\r\n* software and technology\r\n\r\n**Topics:**\r\n\r\n* looks into many different problems with children\r\n\r\n  * education\r\n\r\n  * life in general\r\n\r\n  * techniques to work around with these problems\r\n\r\n  * problem solving in problem solving\r\n\r\n  * thinking progress\r\n\r\n**Problem position:**\r\n\r\n* problems all over the world\r\n\r\n* if we do not solve them we will die\r\n\r\n* not every problem is the same danger\r\n\r\n* problems rise our horizon in thinking\r\n\r\n* all life is problem solving\r\n\r\n* needs of ourself must be identified\r\n\r\n  * visible (are they visible if not how do we see it)\r\n\r\n  * accessible (can we touch it)\r\n\r\n  * actionable (can we do something about it)\r\n\r\n* the blind and the elephant analogy\r\n\r\n* operating in silence\r\n\r\n**Example:**\r\n\r\n* obesity\r\n\r\n  * approach from a wide perspective\r\n\r\n  * look at it like the blind and the elephant\r\n\r\n  * no common language to engage with other professionals\r\n\r\n  * different perspective\r\n\r\n  * obesity system influence diagram\r\n\r\n  * interdisciplinary diagram (arj.net)\r\n\r\n  * the iceberg as a system thinking tool)\r\n\r\n  * complex problems -> complex landscape\r\n\r\n  * searching for a common pipe that we can tackle\r\n\r\n**Bumps:**\r\n\r\n* a visual way to work on problems\r\n\r\n* bump = obstacle that is the problem\r\n\r\n* for everyone is a different bump\r\n\r\n* bumps are complex by itself\r\n\r\n* there is also intersections of different bumps\r\n\r\n* diagram from problem solving people to society'),
(173, 1560935279, 0, 56, 7, 'This meeting was quite different since the speakers came from all over the world to talk to us about their experiences on digital methods.\r\n\r\n1. Ken Carroll (Netherlands) presentation on BUMP “Big Unsolved Meaningful Problems Worth Solving”\r\n2. James Gien Wong (South Africa) presentation of planetary boundaries, related approaches, and plans;\r\n3. Michael - presentation about Kumu.io for visualizing data'),
(174, 1560935318, 0, 58, 7, '**Webpage: [https://bumps.world/](https://bumps.world/)**\r\n\r\n**Person:**\r\n\r\n* Ken Carrol\r\n\r\n* living in netherland\r\n\r\n* software and technology\r\n\r\n**Topics:**\r\n\r\n* looks into many different problems with children\r\n\r\n  * education\r\n\r\n  * life in general\r\n\r\n  * techniques to work around with these problems\r\n\r\n  * problem solving in problem solving\r\n\r\n  * thinking progress\r\n\r\n**Problem position:**\r\n\r\n* problems all over the world\r\n\r\n* if we do not solve them we will die\r\n\r\n* not every problem is the same danger\r\n\r\n* problems rise our horizon in thinking\r\n\r\n* all life is problem solving\r\n\r\n* needs of ourself must be identified\r\n\r\n  * visible (are they visible if not how do we see it)\r\n\r\n  * accessible (can we touch it)\r\n\r\n  * actionable (can we do something about it)\r\n\r\n* the blind and the elephant analogy\r\n\r\n* operating in silence\r\n\r\n**Example:**\r\n\r\n* obesity\r\n\r\n  * approach from a wide perspective\r\n\r\n  * look at it like the blind and the elephant\r\n\r\n  * no common language to engage with other professionals\r\n\r\n  * different perspective\r\n\r\n  * obesity system influence diagram\r\n\r\n  * interdisciplinary diagram (arj.net)\r\n\r\n  * the iceberg as a system thinking tool)\r\n\r\n  * complex problems -> complex landscape\r\n\r\n  * searching for a common pipe that we can tackle\r\n\r\n**Bumps:**\r\n\r\n* a visual way to work on problems\r\n\r\n* bump = obstacle that is the problem\r\n\r\n* for everyone is a different bump\r\n\r\n* bumps are complex by itself\r\n\r\n* there is also intersections of different bumps\r\n\r\n* diagram from problem solving people to society'),
(175, 1560935543, 0, 57, 25, '#              \r\n\r\n# [https://www.mendeley.com/?interaction_required=true](https://www.mendeley.com/?interaction_required=true)\r\n\r\nFor Whom:\r\n\r\n* Everyone (MacOs,Linux ,iOS and Windows)\r\n\r\n* Academics, Autobiographers, Biographers, Children\'s Authors, Journalists, Lawyers, Novelists, Poets, Screenwriters, students, Translators\r\n\r\nWhat:\r\n\r\n* word processing program and outliner designed for Authors\r\n\r\n* provides a management system for documents, notes and metadata\r\n\r\n* works with reference manager\r\n\r\n* can direct and store pdf file\r\n\r\n* color coding(let you add coloured tabs)\r\n\r\n* session target (can count words)\r\n\r\n* can write comments on your writings\r\n\r\nHow much:\r\n\r\n* Trial period (30 days ): free\r\n\r\n* macOS user and windows: approximately 40 euro\r\n\r\n* educational licence(for student and academics ):approximately 34 euro\r\n\r\n---\r\n\r\n[Like ](https://eportfolio.wineme.fb5.uni-siegen.de/index.php?r=wiki%2Fpage%2Fview&title=Scrivener+%40+Tool+%40+Writing+&cguid=5e468faa-cd70-405b-a34b-5309f668eec6#)· [Comment](https://eportfolio.wineme.fb5.uni-siegen.de/index.php?r=wiki%2Fpage%2Fview&title=Scrivener+%40+Tool+%40+Writing+&cguid=5e468faa-cd70-405b-a34b-5309f668eec6#)'),
(176, 1560936018, 0, 57, 25, '# \r\n\r\n# Mendeley :[https://www.mendeley.com/?interaction_required=true](https://www.mendeley.com/?interaction_required=true)\r\n\r\nFor Whom:\r\n\r\n* Everyone (MacOs,Linux ,iOS and Windows)\r\n* \r\n\r\nWhat:\r\n\r\nMendeley is reference manager and academic social network that can help you organize your research, collaborate with others online, and discover the latest research:\r\n\r\n* Automatically generate bibliographies\r\n\r\n* Collaborate easily with other researchers online\r\n\r\n* Easily import papers from other research software\r\n\r\n* Find relevant papers based on what you\'re reading\r\n\r\n* Access your papers from anywhere online\r\n\r\nHow much:\r\n\r\npros\r\n\r\ncons'),
(177, 1560936022, 0, 59, 7, '**Person:**\r\n\r\n* James Gien Wong\r\n* [https://stopresetgo.org/](https://stopresetgo.org/)\r\n* Working from south africa\r\n\r\n**Video:**\r\n\r\n* explaining the project\r\n* the bottom of change on the mass of scale\r\n* 100 citys is to low 10000 citys are to many\r\n* Networks that treat planetary boundaries\r\n  * many networks of citys\r\n\r\n  * citys need to be onboarded\r\n\r\n  * they need a lot of data\r\n\r\n  * 200 megacity\r\n\r\n    * but not only megacity are important but all citys as long the data is curated and someone makes it accessible\r\n\r\n  * urban boundaries are important\r\n\r\n  * mostly top down processes\r\n\r\n    * citys\r\n\r\n    * ngo\r\n\r\n    * governance\r\n\r\n  * **but people are the important factor**\r\n\r\n    * commons\r\n\r\n    * tipping point festival\r\n\r\n    * what actors are involved?\r\n\r\n      * through the organisators\r\n\r\n      * maybe Essen (Germany) will be involved soon\r\n\r\n      * the words spreads really good and many communities seem to come on board for the festivals\r\n\r\n\r\n* [https://tippingpointfestival.org/](https://tippingpointfestival.org/)\r\n\r\n### **planetary boundaries are found in 2009**\r\n\r\n* radar graph circular\r\n\r\n* it displays the problems that the planet has right now\r\n\r\n* [https://www.stockholmresilience.org/research/planetary-boundaries/planetary-boundaries/about-the-research/the-nine-planetary-boundaries.html](https://www.stockholmresilience.org/research/planetary-boundaries/planetary-boundaries/about-the-research/the-nine-planetary-boundaries.html)\r\n\r\n* people are revealing around that\r\n\r\n* no-one lives in all the plant but in cities\r\n\r\n* boundaries are coming from cities\r\n\r\n  * they can bend the curve collectively for the whole plant\r\n\r\n  * 60% of earth population is in the cities in a few years\r\n\r\n  * 20% of the earth population is causing 90% of the problems\r\n\r\n  * wealthy people are the problem\r\n\r\n  * 80% of the people causing 10% of the problems\r\n\r\n* Berkeley professors have no problem addressing the many people\r\n\r\n* the idea is to make working groups in the citys to manage each of the problem by themselves\r\n\r\n* biophysical boundaries are different\r\n\r\n  * socio economic indicators\r\n\r\n  * equals the problem at the point of view\r\n\r\n* not much time to make a huge change\r\n\r\n* accomplish such a huge amount of change never happened\r\n\r\n  * a lot of cost is involved and a lot of change\r\n\r\n* closely nit groups and gather the\r\n\r\n* identifying the planetary boundary at the location is a main problem\r\n\r\n* many groups are interested in this developments\r\n\r\n  * many stakeholder (like festivals, communities)\r\n\r\n  * Achieve the 1000 citys\r\n\r\n  * global livinglab\r\n\r\n  * hackathon\r\n\r\n  * build a system from it\r\n\r\n  * 100mio $ from a foundation\r\n\r\n* tipping point festivals\r\n\r\n  * like the fusion\r\n\r\n  * anti brand movement?\r\n\r\n  * what have brands to do with the festivals\r\n\r\n  * sponsoring?\r\n\r\n* no really answer to it'),
