(179, 1560936879, 0, 60, 7, '* Kumu is a visualisation tool to make data visible\r\n\r\n* like the stakeholder in a project\r\n\r\n* names or institutions or initiatives\r\n\r\n* can be gathered and make visible problems very fast\r\n\r\n* planetary function in kumu to map points to the planet\r\n\r\n* gamefication aspect\r\n\r\n  * bending the curve\r\n\r\n  * each city has an identity and\r\n\r\n  * real time trends\r\n\r\n  * how well are they doing the challenge between the citys are the gamification aspect\r\n\r\n  * feedback\r\n\r\n  * all people are working in one challenge\r\n\r\n* unintended consequences can be seen\r\n\r\n* holistically see what the bumps are\r\n\r\n* normally one sees the impact when the study is'),
(180, 1560937616, 0, 60, 7, '### **KUMU.io - [https://kumu.io/](https://kumu.io/)**\r\n\r\n* Kumu.io is a visualisation tool\r\n* like the stakeholder in a project\r\n* names or institutions or initiatives\r\n* can be gathered and make visible problems very fast\r\n* planetary function in kumu.io to map points to the planet\r\n* gamification aspect\r\n  * bending the curve\r\n  * each city has an identity and\r\n  * real time trends\r\n  * how well are they doing the challenge between the citys are the gamification aspect\r\n  * feedback\r\n  * all people are working in one challenge\r\n* unintended consequences can be seen\r\n* holistically see what the bumps are\r\n\r\nMaps form a pretty good visual basis for everyone\r\n\r\nExample: [https://kumu.io/mbh66/dummy-map-of-regeneration](https://kumu.io/mbh66/dummy-map-of-regeneration) (takes a little to load)\r\n\r\narcgis.com/en'),
(181, 1560937719, 1, 56, 7, 'This meeting was quite different since the speakers came from all over the world to talk to us about their experiences on digital methods.\r\n\r\n1. Ken Carroll (Netherlands) presentation on BUMP “Big Unsolved Meaningful Problems Worth Solving”\r\n2. James Gien Wong (South Africa) presentation of planetary boundaries, related approaches, and plans;\r\n3. Michael - presentation about Kumu.io for visualizing data'),
(182, 1560937746, 0, 50, 7, 'After the introduction of the speaker and the people attending we will hear and discuss about the ongoing while working ethnographically in a given field of research.\r\n\r\nHelena Krasti will hold a presentation about her experiences and will open the discussion for QandA afterwards.'),
(183, 1560937820, 0, 40, 7, '* After the intro, we will explore the first topic *“Time management and organizing workflow”*. We will dig more into the issue of productivity, time management, workflow and explore possible best practices.\r\n\r\n  * Timo Kaerlein will show how the CRC coordination is using Trello to support their work;\r\n\r\n  * Gaia Mosconi will show a tool called “Bear” and “Nuclino” both already mentioned in WiSe 2018 but not explored in details.\r\n\r\n  * We invite all of you to show us what works for you the best but also what are your major struggles concerning time management, workflow, and productivity.'),
(184, 1560937856, 0, 45, 7, ''),
