(194, 1562164757, 0, 57, 25, '# \r\n\r\n# Mendeley: [Mendeley link](https://www.mendeley.com/?interaction_required=true \"Mendeley link\")\r\n\r\nFor Whom:\r\n\r\n* Everyone (MacOs,Linux ,iOS and Windows)\r\n\r\nWhat:\r\n\r\n**Mendeley is reference manager and academic social network that can help you organize your research, collaborate with others online, and discover the latest research:**\r\n\r\n* Automatically generate bibliographies\r\n* Collaborate easily with other researchers online\r\n* Easily import papers from other research software\r\n* Find relevant papers based on what you\'re reading\r\n* Access your papers from anywhere online\r\n\r\nHow much:     free of cost\r\n\r\npros:              Cleaner design and usability\r\n\r\ncons :              you do not have an option to export or import individual folders.'),
(195, 1562164893, 1, 10, 25, '## Asana: [https://asana.com/](https://asana.com/)\r\n\r\n**Whom: everyone!**\r\n\r\n**What:**\r\n\r\n* Browser app!\r\n* Map out each step and organize all the details of your work in one place;\r\n* Use **Timeline to create a plan** that shows you how the pieces of your project fit together, and helps you **keep work on track as things change**;\r\n* **A very good feature:** in ASANA you can assign topic directly from your email:  when you register in your account you get provided with an email and you can link topics to it that then get upload in your ASAN board directly!\r\n\r\n**How much:**\r\n\r\n* Basic: free\r\n* Premium: €9,25/Per user, per month billed annually\r\n* Business: €18,75Per user, per month billed annually\r\n\r\n![Asana.png](file-guid:d2e0a7a2-a18b-4e74-9397-6224d7c9a8de \"Asana.png\")'),
(196, 1563180561, 1, 61, 10, 'Here some links we discussed and looked at in the last Research Tech Lab session:\r\n\r\n1.  Data security guidelines from the University of Michigan: [https://research-compliance.umich.edu/data-security-guidelines](https://research-compliance.umich.edu/data-security-guidelines)\r\n2.  A guide designed to help you make informed decisions about where to safely store and share university data (again from the University of Michigan) [https://safecomputing.umich.edu/dataguide/](https://safecomputing.umich.edu/dataguide/) - it would be a nice project for ZIMT ([@Volker Hess](https://research-hub.social/index.php?r=user%2Fprofile&cguid=8ddcb212-5872-47e1-a547-292cbc717e9e)) - ZIMT could come us with something similar perhaps?!\r\n3.  A quite detailed informed consent, with clear links to the GDPR regulation, you can find it at the voice - “Where do i find the Notice”: [https://ria.princeton.edu/General%20Data%20Protection%20Regulation](https://ria.princeton.edu/General%20Data%20Protection%20Regulation) (University of Princeton)'),
(197, 1563203843, 0, 45, 25, ''),
