(200, 1563205497, 0, 59, 25, '**Person:**\r\n\r\n* James Gien Wong\r\n* [https://stopresetgo.org/](https://stopresetgo.org/)\r\n* Working from south africa\r\n\r\n**Video:**\r\n\r\n* explaining the project\r\n* the bottom of change on the mass of scale\r\n* 100 cities are too low and 10000 cities are too much\r\n* Networks that treat planetary boundaries\r\n  * many networks of cities\r\n  * cities need to be onboarded\r\n  * they need a lot of data\r\n  * 200 megacity\r\n    * but not only megacity are important but all citys as long the data is curated and someone makes it accessible\r\n  * urban boundaries are important\r\n  * mostly top down processes\r\n    * cities\r\n    * ngo\r\n    * governance\r\n  * **but people are the important factor**\r\n    * commons\r\n    * tipping point festival\r\n    * what actors are involved?\r\n      * through the organisation\r\n      * maybe Essen (Germany) will be involved soon\r\n      * the words spread really good and many communities seem to come on board for the festivals\r\n* [https://tippingpointfestival.org/](https://tippingpointfestival.org/)\r\n\r\n### **planetary boundaries are found in 2009**\r\n\r\n* radar graph circular\r\n* it displays the problems that the planet is facing right now\r\n* [https://www.stockholmresilience.org/research/planetary-boundaries/planetary-boundaries/about-the-research/the-nine-planetary-boundaries.html](https://www.stockholmresilience.org/research/planetary-boundaries/planetary-boundaries/about-the-research/the-nine-planetary-boundaries.html)\r\n* people are revealing around that\r\n* no-one lives in all the plant but in cities\r\n* boundaries are coming from cities\r\n  * they can bend the curve collectively for the whole plant\r\n  * 60% of earth population will be in the cities in a few years\r\n  * 20% of the earth population is causing 90% of the problems\r\n  * wealthy people are the problem\r\n  * 80% of the people causing 10% of the problems\r\n* Berkeley professors have no problem addressing the many people\r\n* the idea is to make working groups in the cities to manage each of the problem by themselves\r\n* biophysical boundaries are different\r\n  * socio economic indicators\r\n  * equals the problem at the point of view\r\n* not enough time to make any huge changes\r\n* accomplish such a huge amount of change  that has never happened\r\n  * a lot of cost is involved and a lot of change\r\n* closely nit groups and gather the\r\n* identifying the planetary boundary at the location is a main problem\r\n* many groups are interested in this developments\r\n  * many stakeholder (like festivals, communities)\r\n  * Achieve the 1000 cities\r\n  * global livinglab\r\n  * hackathon\r\n  * build a system from it\r\n  * 100million $ from a foundation\r\n* tipping point festivals\r\n  * like the fusion\r\n  * anti brand movement?\r\n  * what have brands to do with the festivals\r\n  * sponsoring?\r\n* no really answer to it'),
(201, 1563205899, 1, 36, 25, '# Discussion about the pro and cons of anonymization\r\n\r\n* are names and all infos important for the analysis?\r\n* blur characters sometimes do not reach the right security level ( although characters are still countable)\r\n  * telling a story in a paper is easier with name (even pseudo names)\r\n* table of fake names (gender, name, etc)\r\n  * in data collection, types of data is important.'),
