the whole problems\r\n* Berkeley professors have no problem addressing the many people\r\n* the idea is to make working groups in the cities, so they can manage each problems by themselves separately.\r\n* biophysical boundaries are quite different\r\n  * socio economic indicators\r\n  * equals the problem at the point of view\r\n* not enough time to make any huge changes\r\n* accomplish such a huge amount of change  that has never happened\r\n  * a lot of cost is involved and a lot of change\r\n* closely nit groups and gather the\r\n* identifying the planetary boundary at the location is a main problem\r\n* many groups are interested in this developments\r\n  * many stakeholder (like festivals, communities)\r\n  * Achieve the 1000 cities\r\n  * global livinglab\r\n  * hackathon\r\n  * build a system from it\r\n  * 100million $ from a foundation\r\n* tipping point festivals\r\n  * like the fusion\r\n  * anti brand movement?\r\n  * what have brands to do with the festivals\r\n  * sponsoring?\r\n* no really answer to it'),
(203, 1563206817, 1, 53, 25, '**Points are:**\r\n\r\n* Ethical conduct\r\n* Reflexibility\r\n* Postionality\r\n  * how you position yourself in an environment\r\n  * age, sexuality etc matters in that kind of things\r\n* Emotional work\r\n  * systematic self reflexivity is important throughout the whole process\r\n\r\n**Keep in mind:**\r\n\r\n* Ethnics is about the people you are studying on and with\r\n* its a trust situation\r\n* ethics are the most important part\r\n* you cannot predict what happens and what you will see\r\n* Each country has different ethical foundations to keep in mind'),
(204, 1563207145, 1, 54, 25, '### **Experiences:**\r\n\r\n**What might evolve when working with and in Ethnography?**\r\n\r\n* not being able to put thought together\r\n* depression\r\n* social connection while being depressed is a huge step - sharing the problem with others\r\n* lot of us can’t do that\r\n* writing progress can be blockend by insecurities about the research itself\r\n* asking feedback is a huge step to deal with\r\n\r\n**Situation in the UK**\r\n\r\n* in the uk the institute is more protected than the relationship between the interviewer - interviewee\r\n* so more researcher -> institute\r\n* sometime the interests between the object of research and the institute is a clash of interests\r\n* public space is borderline issue\r\n* guidelines of the police monitoring people is a best practice to follow\r\n* blurring faces is a common practice\r\n\r\n**Filming children**\r\n\r\n* data only for research afterwards get it back to the people\r\n* approval from parents to film their childrens.\r\n* materials will not be published\r\n* teenager 12-14 is the same situation\r\n* archiving the data can be good for the further career\r\n* what you say and what you do are sometimes different processes\r\n* long term research projects need the data for reuse\r\n\r\n**Ethnographic research analysis is not a phase but it goes through the whole research**\r\n\r\n* iterative\r\n* data is not the problem but having too much can be a problem\r\n* watching data with the interviewee together can be deliberating and gives a compact view from another point'),
(205, 1563208522, 0, 48, 25, 'Following applications can be used to write down any quick or long notes.\r\n\r\n* **MS Word (**[https://products.office.com/en-us/try](https://products.office.com/en-us/try) **)**\r\n  * a word processor from the microsoft Corporation often known as Word\r\n  *  it has many helpful tools to make documents that you can print and publish\r\n  * can be used to create personal, educational and workplace documents\r\n  * collaborate on documents with real time co-authoring  with team members anytime and from anywhere\r\n  * works on Windows Operating System, also compatible for IOS and not Compatible for Linux\r\n  * 30 days free trial version can be downloaded online after that the yearly package has to be purchased\r\n* Dropbox Paper\r\n\r\n  Launced on 2017 by company Dropbox\r\n\r\n  Is a collaborative document  editing and noting service  developed by dropbox\r\n\r\nulysses,draft 5(iOS)'),
(206, 1563208728, 0, 48, 25, 'Following applications can be used to write down any quick or long notes.\r\n\r\n* **MS Word (**[Microsoft Office Package](https://products.office.com/en-us/try) **)**\r\n  * a word processor from the microsoft Corporation often known as Word\r\n  * it has many helpful tools to make documents that you can print and publish\r\n  * can be used to create personal, educational and workplace documents\r\n  * collaborate on documents with real time co-authoring  with team members anytime and from anywhere\r\n  * works on Windows Operating System, also compatible for IOS and not Compatible for Linux\r\n  * 30 days free trial version can be downloaded online after that the yearly package has to be purchased\r\n* Dropbox Paper\r\n\r\n  Launced on 2017 by company Dropbox\r\n\r\n  Is a collaborative document  editing and noting service  developed by dropbox\r\n\r\nulysses,draft 5(iOS)'),
(207, 1563209772, 1, 48, 25, 'Following applications can be used to write down any quick or long notes.\r\n\r\n* **MS Word (**[Microsoft Office Package Download](https://products.office.com/en-us/try) **)**\r\n  * a word processor from the microsoft Corporation often known as Word\r\n  * it has many helpful tools to make documents that you can print and publish\r\n  * can be used to create personal, educational and workplace documents\r\n  * collaborate on documents with real time co-authoring  with team members anytime and from anywhere\r\n  * works on Windows Operating System, also compatible for IOS and not Compatible for Linux\r\n  * 30 days free trial version can be downloaded online after that the yearly package has to be purchased\r\n* Dropbox Paper ([Dropbox Paper Download](https://www.dropbox.com/en/paper))\r\n\r\n  a collaborative document  editing and noting service  developed by dropbox on 2017 and easily accesible online \r\n* Draft 5([Draft Download](https://getdrafts.com/))\r\n\r\n  quick capture notetaking app only for the iOS users'),
(208, 1563210104, 0, 45, 25, '\r\ncitavi :\r\n\r\nCapable of importing all your references,\r\nwritting comment directly quoting specific passages\r\ncan rewrite your own words but for the mac user it is a bit complicated\r\nzotero :\r\n\r\ntake different topics and issues that make it real simple to use\r\nwhen exporting doesnt show the page numbers and all must write again#\r\nMendeley:\r\n\r\nis very easy to use but cant export the notes and documents\r\nhas updated a lot in these 2 years'),
(209, 1563210807, 0, 45, 25, 'Experiences and Feedbacks from the Research TechLab participants on 30.04.2019\r\n\r\n**Citavi :**\r\n\r\n* Capable of importing all your references,\r\n* writing comment directly quoting specific passages \r\n* can rewrite your own words\r\n* Not user friendly among the mac users\r\n\r\n**Zotero**\r\n\r\n* take different topics and issues that make it real simple to use\r\n*  when exporting doesnot show the page numbers and all page numbers has to be written again\r\n\r\n**Mendeley**\r\n\r\n* is very easy to use but cannot export the notes and documents \r\n* has been updated frequently in last 2 years'),
(210, 1563211300, 1, 41, 25, '# Main keyword is - self discipline\r\n\r\n* fit the tools to the tasks you are doing\r\n* pomodoro technique\r\n  * you read about in the teclabs wiki: [http://tinyurl.com/y6gbgpat](http://tinyurl.com/y6gbgpat)\r\n  * there is a browser app\r\n  * Mobile apps are also available\r\n* bear - notes tool - ([Bear App Download](https://bear.app/))\r\n  * beautiful, flexible writing app for crafting notes, to do list and prose.\r\n  * for Iphone, Ipad and Mac Users \r\n  * helped not getting lost in the process\r\n  * really less notifications \r\n  * since it is a note taking tool the notifications are not planned that frequently\r\n* do not use too many tools'),
(211, 1563211332, 0, 45, 25, 'Experiences and Feedbacks from the Research TechLab participants on 30.04.2019\r\n\r\n**Citavi :**\r\n\r\n* Capable of importing all your references,\r\n* writing comment directly quoting specific passages \r\n* can rewrite your own words\r\n* Not user friendly among the mac users\r\n\r\n**Zotero**\r\n\r\n* take different topics and issues that make it real simple to use\r\n*  when exporting doesnot show the page numbers and all page numbers has to be written again\r\n\r\n**Mendeley**\r\n\r\n* is very easy to use but cannot export the notes and documents \r\n* has been updated frequently in last 2 years'),
(212, 1563211955, 0, 57, 25, '# \r\n\r\n# Mendeley: [Mendeley link](https://www.mendeley.com/?interaction_required=true \"Mendeley link\")\r\n\r\nFor Whom:\r\n\r\n* All Users (MacOs,Linux ,iOS and Windows)\r\n\r\nWhat:\r\n\r\nMendeley is reference manager and academic social network platform that helps everyone to  organize their research, collaborate with others online, and discover the latest research in their field of interest.\r\n\r\n* automatically generate bibliographies\r\n* easy and quick online collaboration with other researchers \r\n* easily import of papers from other research software\r\n* find relevant papers based on interest\r\n* online, fast and secure access \r\n\r\nPrice:             Free of use\r\n\r\npros:              Usability\r\n\r\ncons :             No option to export or import individual folders'),
(213, 1563212340, 1, 14, 25, '* gdrive\r\n  * data security (privacy is not secured, server location questionable)\r\n  * not open source (self hosting not possible)\r\n* sandstorm (alternative for gdrive) [link](http://www.sandstormsolution.com/)\r\n* Altlassian (which tools it?) [link](https://de.atlassian.com/)\r\n* trello [link](https://trello.com/en)\r\n* jira [link](https://www.atlassian.com/software/jira/try?&aceid=&adposition=1t1&adgroup=64979489988&campaign=1450692435&creative=340003297563&device=c&keyword=jira&matchtype=e&network=g&placement=&ds_kids=p34375792677&ds_e=GOOGLE&ds_eid=700000001558501&ds_e1=GOOGLE&gclid=EAIaIQobChMIkOvw_7q34wIVAbDtCh07XwBtEAAYASACEgLx2vD_BwE&gclsrc=aw.ds) \r\n* mattermost (open source version of slack)\\\r\n  selfhosting or cloud hosting\\\r\n  [link](https://mattermost.com/)\r\n* Slack [link](https://slack.com/intl/de-de/)'),
(214, 1563212558, 1, 17, 25, '## **Citavi: [https://www.citavi.com/en](https://www.citavi.com/en)**\r\n\r\n**Whom: only windows - licence based**\r\n\r\n**What:**\r\n\r\n* export is not perfect\r\n* only oneway export to zotero is possible\r\n* reading in citavi is possible\r\n* markings can be set in the text and have comments on it\r\n* sort the marking\r\n* mac version not available till date\r\n* overkill of features\r\n\r\n![Citavi-1440600120-0-0.jpg](file-guid:f3d40496-14f9-4b92-a66f-000565cf3e73 \"Citavi-1440600120-0-0.jpg\")'),
(215, 1563212792, 1, 18, 25, '## **Maxqda: [https://www.maxqda.com/](https://www.maxqda.com/)**\r\n\r\n**Whom: everyone but license required!**\r\n\r\n**What:**\r\n\r\n* Qualitative data analysis tool\r\n* overkill of features\r\n* for large sets of data\r\n* categorize the literature after working with it in zotero\r\n* integration of all kinds of media\r\n* combination of zotero and maxqa\r\n\r\n**How much:**\r\n\r\n* you can check licenses here: [https://www.maxqda.com/licenses](https://www.maxqda.com/licenses)\r\n\r\n![Maxqda.png](file-guid:613e98c8-6ad4-4691-9af9-801fd2c34238 \"Maxqda.png\")'),
(216, 1563212973, 1, 15, 25, '## **Zotero: [https://www.zotero.org/](https://www.zotero.org/)**\r\n\r\n* managing the texts\r\n* merging everything into tools like zotero\r\n* includes GB of full books\r\n* open source platform, big support community, forum\r\n* addons\r\n* good integration\r\n* supports many formats but not epub (e.g.)\r\n* downside is the not existent mobile app\r\n* GUI is not that appealing\r\n* structure the collection of texts in your own way\r\n* citing in writing tool is easy (at least word)\r\n* timeline function\r\n* sharing through groups is possible\r\n* but sometimes it is a privacy issue too\r\n* webdav server on sciebo (was not working?)\r\n* save th\r\n* embedding an addon (wordpress) to enable people to search through the database\r\n\r\n![zotero.png](file-guid:9b4f4a1c-c411-46cc-86f8-8a46a985cbe9 \"zotero.png\")'),
(217, 1563213094, 1, 19, 25, '* solves many problems of the literature management\r\n* wikimedia and wikicite the new initiatives from wikipedia\r\n* backbone of the internet\r\n* interrelation of facts\r\n* make the literature work more relevant since you do not have to make it over and over again\r\n* altruistic attempt to make research more usable and search/findable in general\r\n* more or less a database of research in general'),
(218, 1563213664, 1, 27, 25, '**Gephi** [link](https://gephi.org/)\r\n\r\n* Gephi is the leading visualization and exploration software for all kinds of graphs and networks. \r\n* For graph data, user can interact with representations to  manipulate the structures, shapes and colors to reveal hidden patterns in graphs\r\n* The main aim is to help data analysts to make hypothesis, intuitively discover patterns and find faults during data sourcing\r\n* Complete open-source and free to download'),
(219, 1563213805, 1, 31, 25, '# Python Scraper - [https://realpython.com/](https://realpython.com/python-web-scraping-practical-introduction/)\r\n\r\n* python scraper is a little more efficient but maybe not so easy to do by oneself\r\n* Basic idea of  programming  is required'),
(220, 1563214436, 1, 58, 25, '**Webpage: [https://bumps.world/](https://bumps.world/)**\r\n\r\n**Person:**\r\n\r\n* Ken Carrol\r\n* living in netherland\r\n* software and technology\r\n\r\n**Topics:**\r\n\r\n* looks into many different problems with children\r\n  * education\r\n  * life in general\r\n  * techniques to work around with these problems\r\n  * problem solving in problem solving\r\n  * thinking progress\r\n\r\n**Problem position:**\r\n\r\n* problems are all over the world\r\n* if we do not solve them then the end is not that far away\r\n* not every problem has the same level of danger\r\n* problems rises our horizon in thinking\r\n* all life is problem solving\r\n* our necessity must be identified \r\n\r\n  Are they?\r\n  * visible (are they visible if not how do we see it)\r\n  * accessible (can we touch it)\r\n  * actionable (can we do something about it)\r\n* the blind and the elephant analogy\r\n* operating in silence\r\n\r\n**Example:**\r\n\r\n* obesity\r\n  * approach from a wide perspective\r\n  * look at it like the blind and the elephant\r\n  * no common language to engage with other professionals\r\n  * different perspective\r\n  * obesity system influence diagram\r\n  * interdisciplinary diagram (arj.net)\r\n  * the iceberg as a system thinking tool)\r\n  * complex problems -> complex landscape\r\n  * searching for a common pipe that we can tackle\r\n\r\n**Bumps:**\r\n\r\n* a visual way to work on problems\r\n* bump = obstacle that is the problem\r\n* for each and everyone there is a different bump\r\n* bumps are complex by itself\r\n* there is also intersections of different bumps\r\n* diagram from problem solving people to society'),
(221, 1563214531, 1, 60, 25, '### **KUMU.io - [https://kumu.io/](https://kumu.io/)**\r\n\r\n* Kumu.io is a visualisation tool\r\n* like the stakeholder in a project\r\n* names or institutions or initiatives\r\n* can be gathered and make visible problems very fast\r\n* planetary function in kumu.io to map points to the planet\r\n* gamification aspect\r\n  * bending the curve\r\n  * each city has an identity and\r\n  * real time trends\r\n  * how well are they doing the challenge between the cities are the gamification aspect\r\n  * feedback\r\n  * all people are working in one challenge\r\n* unintended consequences can be seen\r\n* holistically see what the bumps are\r\n\r\nMaps form a pretty good visual basis for everyone\r\n\r\nExample: [https://kumu.io/mbh66/dummy-map-of-regeneration](https://kumu.io/mbh66/dummy-map-of-regeneration) (takes a little bit of time to load)\r\n\r\narcgis.com/en'),
(222, 1563215445, 1, 62, 25, 'Experiences and Feedbacks from the Research TechLab participants on 30.04.2019\r\n\r\nCitavi :\r\n\r\n* Capable of importing all your references,\r\n\r\n* writing comment directly quoting specific passages\r\n\r\n* can rewrite your own words\r\n\r\n* Not user friendly among the mac users\r\n\r\nZotero\r\n\r\n* take different topics and issues that make it real simple to use\r\n\r\n* when exporting doesnot show the page numbers and all page numbers has to be written again\r\n\r\nMendeley\r\n\r\n* is very easy to use but cannot export the notes and documents\r\n\r\n* has been updated frequently in last 2 years'),
