(231, 1564474763, 1, 40, 10, '* After the intro, we will explore the first topic *“Time management and organizing workflow”*. We will dig more into the issue of productivity, time management, workflow and explore possible best practices.\r\n\r\n  * Timo Kaerlein will show how the CRC coordination is using Trello to support their work;\r\n\r\n  * Gaia Mosconi will show a tool called “Bear” and “Nuclino” both already mentioned in WiSe 2018 but not explored in details.\r\n\r\n  * We invite all of you to show us what works for you the best but also what are your major struggles concerning time management, workflow, and productivity.'),
(232, 1564474885, 1, 50, 25, 'After the introduction of the speaker and the people attending we will hear and discuss about the ongoing while working ethnographically in a given field of research.\r\n\r\nHelena Krasti will hold a presentation about her experiences and will open the discussion for Q&A afterwards.'),
(233, 1564474989, 1, 57, 25, '# \r\n\r\n# Mendeley: [Mendeley link](https://www.mendeley.com/?interaction_required=true \"Mendeley link\")\r\n\r\nFor Whom:\r\n\r\n* All Users (MacOs,Linux ,iOS and Windows)\r\n\r\nWhat:\r\n\r\nMendeley is reference manager and academic social network platform that helps everyone to  organize their research, collaborate with others online, and discover the latest research in their field of interest.\r\n\r\n* automatically generate bibliographies\r\n* easy and quick online collaboration with other researchers\r\n* easily import the papers from other research software\r\n* find relevant papers based on interest\r\n* online, fast and secure access\r\n\r\nPrice:             Free of use\r\n\r\npros:              Usability\r\n\r\ncons :             No option to export or import individual folders');
